INSERT INTO `mee_adminnotification_inbox` VALUES (1,1,'2018-02-27 22:45:55','Magento Open Source 1.9.3.8 and SUPEE-10570 Enhance Security and Functionality – 2/27/2018','Magento Open Source 1.9.3.8 and the SUPEE-10570 patch include critical security enhancements and feature updates, including support for recent USPS API changes. Review the release notes for more information: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html ','http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,1),(2,1,'2018-04-09 08:03:15','Take Steps to Protect Your Site ','Our goal is to help you deliver the highest level of security to your Magento site. \n\nYou now have access to a security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. It provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. Please be sure to set your site up for security scanning – activation is quick and easy. Access today in your Magento account.\n\nYou should also visit our Security Center which provides alerts around potential issues as well as best practices to help you protect your site against issues, such as brute force attacks. Brute-force password guessing attacks continue to target Magento Open Source (formerly Community Edition) sites worldwide and we have published an  article that explains multiple actions you can take to protect your site from such attacks. In some cases, these attacks have resulted in unauthorized administrative access, so it is important to implement these recommendations.\n\nTo visit the Magento Security Center:\nwww.magento.com/security\n\nTo view steps you can take to protect against issues like brute force, go to:\nwww.magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks\n','https://magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks',0,1),(3,4,'2018-05-03 00:07:01','Magento Open Source 2.2.4 Enables Better Shopping Experiences with Integrated Payment, Tax, and Shipping Solutions – 5/2/2018','The latest release of Magento Open Source empowers merchants to create better shopping experiences with performance enhancements and integrations with Amazon Pay, Klarna, and Vertex. Learn how these features can help you reduce cart abandonment and increase average order value, while simplifying your operations at https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce','https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce',0,1),(4,1,'2018-06-27 21:45:16','Magento Open Source 2.2.5 delivers important security updates along with performance and functionality enhancements – 6/27/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.5-and-2.1.14-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,1),(5,4,'2018-07-17 02:55:59','Survey: Help us improve the Admin Panel usability by taking this 5 minute survey.','We\'d like to invite you to take our online survey on Admin Panel Usability. Your input is valuable to us and will help to inform the user experience direction. The survey should take no more than 5 minutes to complete.\n \nTo get started, go to:\nhttps://www.surveymonkey.com/r/SUS-AdHoc-M1 ','https://www.surveymonkey.com/r/SUS-AdHoc-M1 ',0,1),(6,1,'2018-09-06 18:22:45','Magento Open Source 1 software security patches thru June 2020','Magento Open Source 1 software security patches thru June 2020\n\nFor Magento Open Source 1.5 to 1.9, we are providing software security patches through June 2020 to ensure those sites remain secure and compliant. Visit our information page for more details about our software maintenance policy and other considerations for your business.\n\nhttps://info2.magento.com/M1OpenSource.html\n','https://info2.magento.com/M1OpenSource.html',0,0),(7,1,'2018-09-19 02:21:37','Magento Open Source 2.2.6 delivers important security updates along with performance and functionality enhancements – 9/18/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.6-and-2.1.15-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,0),(8,2,'2018-09-27 18:49:45','PHP 7.2 support patches are now available for Magento 1','PHP 7.2 support patches for Magento 1 are now available. It is critical you are on a supported version of PHP to ensure your site is secure and in compliance. For compatibility and download details, please visit our developer forum post.\n\nhttps://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211','https://community.magento.com/t5/News-Announcements/PHP-7-2-Support-Patches-for-Magento-1-are-now-available/m-p/106999#M211',0,0),(9,1,'2018-11-28 23:03:26','Magento Commerce 1.9.4.0 adds PHP 7.2 support along with security enhancements – 11/28/2018','The latest release of Magento Open Source 1 adds support for PHP 7.2 and delivers important security enhancements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about these enhancements. For more information about security updates included in this version of Magento please see our Security Center: https://magento.com/security/patches/supee-10975','https://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,0),(10,4,'2018-12-13 00:08:11','What does 2019 look like for you? Take our Retail Trends survey!','Let us know what\'s important to you and your business in 2019!\n\nWe invite you to take our retail trends survey which should take no more than a few minutes to complete. As always, any individual information you provide will remain strictly confidential.\n\nYou can take the survey at: \nwww.surveymonkey.com/r/GHNQTJ2','https://www.surveymonkey.com/r/GHNQTJ2',0,0),(11,4,'2018-12-19 00:29:24','Take our brief product survey.','We are evaluating adding a media library into the Magento content management system to enable merchants to access their own saved media without re-uploading it each time. This media library may also potentially include third-party stock media with a selection of free and paid media (images, videos, etc.).\n\nTake our survey here: https://www.surveymonkey.com/r/MWJJWQP \n\nYour survey answers will help us determine the level of interest in these features.','https://www.surveymonkey.com/r/MWJJWQP ',0,0);
