  <h1><a name=\"top\"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\n    <ul class=\"disc\">\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\n        <li><a href=\"#opera\">Opera 7.x</a></li>\n    </ul>\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n</div>\n','2018-08-07 17:28:41','2018-08-07 17:28:41',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Política de Privacidade','one_column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy Policy','Política de Privacidade e Segurança\r\nO que é a política de privacidade do Portal Meelco Comercial? Confira!\r\nPor: Equipe Meelco Comercial – Set/2018\r\nA Política de Privacidade e Segurança abaixo constitui parte integrante dos Termos e Condições de Uso.\r\n1. Identificação\r\nEste site é de propriedade, mantido, e operado por Meelco Comercial Omnichannel Ltda., com endereço na Rua Cel Carlos Oliva, 231, Tatuapé – São Paulo - SP, inscrita no CNPJ/MF sob o nº 26.524.420/0001-60.\r\n2. Contato – CMC (Central de Atendimento Meelco Comercial)\r\nCaso o Usuário necessite de qualquer informação, esclarecimento ou atendimento com relação a esta Política de Privacidade e Segurança, a Meelco Comercial disponibiliza o CMC para receber todas as comunicações que o Usuário desejar fazer. O CMC opera por meios dos canais de comunicação listados abaixo: (a) Presencialmente, em qualquer uma das lojas físicas Meelco Comercial, durante os horários de funcionamento; (b) Pelo telefone 2225-1355, de segunda a sábado das 8h às 22h e domingos das 9h às 20h; (c) Por correspondência endereçada à MEELCO COMERCIAL, Rua Cel Carlos Oliva, 231, Tatuapé - SP, CEP 03067-010, São Paulo – SP; (d) Por Email: contato@meelcocomercial.com.br, sempre acompanhada das informações de contato do consumidor, para que possamos finalizar o atendimento. Em todos os casos, o Usuário receberá, pelo mesmo canal de comunicação, uma confirmação imediata do recebimento da sua demanda, que será tratada e respondida em um prazo máximo de 5 (cinco) dias. Além disso, a Meelco Comercial disponibiliza neste site uma seção de FAQ (Perguntas mais frequentes), bem como suas demais políticas: Política de Trocas e Devoluções, Política de Pagamentos, Política de Entrega de Produtos, Regulamento do Programa Meelco Comercial com Você e, finalmente, os Termos e Condições de Uso deste Site. Todos estes documentos podem ser consultados online ou baixados pelos usuários em formato PDF para consulta off-line e arquivo.\r\n3. Informações gerais\r\nA Meelco Comercial toma todas as medidas necessárias para proteger a privacidade do Usuário, em atendimento à legislação em vigor. Este documento detalha as formas de coleta, guarda, utilização, compartilhamento e divulgação de seus dados pessoais, bem como aponta claramente as medidas tomadas para assegurar a proteção dos dados coletados.\r\n4. Coleta, utilização e guarda dos dados\r\nColeta de dados: Conta de Acesso. Para a criação de uma Conta de Acesso no Site, o Usuário deve preencher um cadastro, que pode variar de complexidade de acordo com as operações que pretende fazer. Desta forma, um cadastro simples composto de endereço de e-mail e CEP será requerido para o envio de mensagens publicitárias e promocionais ao Usuário sobre produtos, serviços, promoções e/ou novidades da Meelco Comercial. Uma Conta de Acesso básica poderá ser feita pelo Usuário a qualquer momento, para inscrições em cursos, por exemplo, mediante preenchimento de formulário contendo nome completo, endereço de e-mail, número de telefone, CEP, sexo, documento de identidade, CPF e criação de uma senha. Para a realização de Compras e participação no Programa Meelco Comercial com Você, o Usuário deverá criar uma Conta de Acesso completa, fornecendo nome completo, endereço de e-mail, número de telefone, CPF, endereço completo (estado, cidade, bairro, rua, número, complemento, informações extras). Os dados fornecidos pelos Usuários serão armazenados e utilizados pela Meelco Comercial, por si ou por terceiros por ela contratados, para fornecer os produtos do Site, realizar as transações comerciais, processar pagamentos a elas relacionados, compartilhar dados, enviar e-mails de ofertas, produtos, serviços e campanhas de marketing, armazenar o histórico de produtos visualizados, promover campanhas de retargeting, personalizar páginas do Site, verificar dados bancários para evitar fraudes (dados não serão armazenados), realizar entregas e devolução e programar ações e benefícios do Programa Meelco Comercial com Você. Os dados poderão ser compartilhados com terceiros contratados pela Meelco Comercial nos termos desta Política, ressaltando-se que a criação de cada Conta de Acesso ou qualquer cadastro no Site, para o qual seja necessário o envio de qualquer dado pessoal do Usuário, pressupõe o consentimento expresso quanto à coleta, uso, armazenamento e tratamento de dados pessoais. O Usuário é responsável, nas esferas civil e criminal, pela veracidade e atualização dos dados fornecidos (inclusive os dados pessoais) e a Meelco Comercial se exime de qualquer reponsabilidade por danos decorrentes do reenchimento incompleto, impreciso ou inexato do cadastro pelo Usuário, sob qualquer meio ou forma, ou, ainda, pelo uso desse cadastro de forma indevida por qualquer terceiro não autorizado a usar tais dados ou, ainda, por terceiros que tenham, devida ou indevidamente, obtido os dados do Usuário para acesso no Site, agindo como se ele fosse. Coleta de dados: Cookies. Visando oferecer a melhor experiência de navegação e Compras ao Usuário, a Meelco Comercial utiliza-se de tecnologias para coletar e armazenar informações relacionadas à visita do Usuário no Site e isso pode incluir o envio de um ou mais cookies ou identificadores anônimos que coletam dados relativos às preferências de navegação e às páginas visitadas pelo Usuário. Desta forma, a apresentação do Site fica personalizada e alinhada aos interesses pessoais do Usuário e a Meelco Comercial fica em condição de elaborar ofertas e benefícios do Programa Meelco Comercial com Você de forma personalizada. A utilização destes dados fica restrita aos objetivos indicados e a Meelco Comercial se compromete a não utilizar ou permitir a utilização de tais dados com outra finalidade. Ademais, a coleta, guarda e tratamento destes dados é absolutamente automatizada, não havendo nenhuma possibilidade de contato humano com os dados em questão. O Usuário pode e poderá, a qualquer tempo, caso discorde da política de cookies acima, utilizar as ferramentas de seu navegador que impedem a instalação de cookies e ainda apagar quaisquer cookies existentes em seu dispositivo de conexão com a internet. Neste caso, é possível que haja falhas em algumas funcionalidades do Site e na seleção de benefícios do Programa Meelco Comercial com Você. A Meelco Comercial poderá ainda utilizar-se de outras tecnologias para a coleta de dados de navegação dos Usuários, comprometendo-se a guardá-los, tratá-los e utilizá-los em conformidade com este Política. \r\nColeta de dados: Registros de acesso. A Meelco Comercial manterá em sua base de dados todas as informações relativas aos acessos do Usuário ao Site, incluindo, mas não se limitando ao endereço IP, às páginas acessadas, aos horários e datas de acesso, e o dispositivo de acesso utilizado, nos termos da legislação vigente. Tais registros poderão ser utilizados em investigações internas ou públicas para averiguação de práticas que possam gerar quaisquer prejuízos à Meelco Comercial, inclusive a prática de crimes em ambientes virtuais. \r\nColeta de dados: Outras formas. A Meelco Comercial poderá coletar dados pessoais do Usuário, que não os identificados aqui, que sejam inseridos pelo Usuário e sobre o Usuário voluntariamente no processo de navegação do Site ou quando entrar em contato com o CMC (Central de Atendimento Meelco Comercial). Finalmente, a Meelco Comercial poderá acessar bases de dados públicas ou privadas para confirmar a veracidade dos dados pessoais informados pelo Usuário, inclusive dados relacionados ao pagamento da Compra. \r\nUtilização de dados: E-mail. A Meelco Comercial utilizará o e-mail do Usuário prioritariamente para enviar informações sobre suas Compras (confirmação de Compra e atualizações da situação). O e-mail cadastrado também será utilizado para comunicação relacionada aos cursos em que o Cliente estiver inscrito, para informações relativas ao Programa Meelco Comercial com Você e para recuperação da senha de acesso do Cliente, em caso de perda ou esquecimento da senha. \r\nUtilização de dados: Publicidade via mala direta, e-mail, MMS ou SMS. No momento do cadastro de seus dados de contato, o Usuário terá a opção de aceitar ou proibir o envio de mensagens publicitárias (incluindo mensagens relativas ao Programa Meelco Comercial com Você). Ademais, a qualquer momento, o Usuário poderá alterar sua decisão, por meio de acesso à sua Conta no Site ou de contato com o CMC (Central de Atendimento Meelco Comercial) ou, ainda, no campo de descadastro existente nas newsletters enviadas pela Meelco Comercial, sendo que nesse caso o descadastramento da base de dados poderá demorar até 5 (cinco) dias para ser efetivada. \r\nUtilização dos dados: Outras formas. Além das formas expostas acima, a Meelco Comercial poderá, a seu exclusivo critério, utilizar os dados pessoais do Usuário nas seguintes formas: (i) atualização de cadastro; (ii) garantia da segurança do Usuário; (iii) resposta a solicitações do próprio Usuário; (iv) informação acerca de alterações nos Termos e Condições de Uso ou das Políticas; (v) elaboração de estatísticas com relação ao uso do Site, garantido o anonimato do Usuário, inclusive para fins de aperfeiçoamento e entendimento do perfil dos Usuários para a melhoria do Site; (vi) aperfeiçoamento de ferramentas de interatividade entre o Site e o Usuário, garantido seu anonimato; (vii) cumprimento de ordens judiciais; e (viii) defesa dos direitos da Meelco Comercial contra o Usuário em procedimentos judiciais ou administrativos. \r\nGuarda dos dados. A Meelco Comercial guardará todos os dados coletados em suas bases de dados protegidas e seguras. Tais dados serão acessados apenas por processos computadorizados automatizados, profissionais autorizados e nos casos listados nesta Política. Caso o Usuário requeira a exclusão de seus dados da base de dados, a Meelco Comercial se reserva o seu direito de manter os dados em questão em cópias de salvaguarda por até 6 (seis) meses, a fim de cumprir obrigações legais de guarda obrigatória.\r\n5. Compartilhamento e divulgação dos dados\r\nA Meelco Comercial tem a confidencialidade dos dados pessoais do Usuário como prioridade em seus negócios. Assim, assume o compromisso de não divulgar, compartilhar, dar acesso a, facilitar acesso a, alugar, vender, trocar ou de qualquer outra forma disponibilizar tais informações a terceiros, sob nenhum pretexto, exceto nos casos autorizados expressamente pelo Usuário, inclusive nos casos indicados abaixo. Com o único intuito de permitir a concretização de Compras no Site, a Meelco Comercial poderá compartilhar dados pessoais dos Usuários com seus parceiros comerciais, como empresas processadoras de pagamentos, administradoras de cartão de crédito e transportadoras. Neste caso, serão compartilhados apenas os dados pessoais imprescindíveis para que o parceiro comercial da Meelco Comercial desempenhe sua atividade (cobrança, entrega, etc.). Ademais, tais parceiros comerciais serão obrigados, por meio de contratos de confidencialidade, a não arquivar, manter em arquivo, compilar, copiar, reproduzir ou compartilhar tais dados com quem quer que seja. A outra hipótese de divulgação de dados pessoais é por meio de uma determinação judicial. Também neste caso, a divulgação ocorrerá apenas na medida necessária para cumprir a determinação judicial, permanecendo sigilosos os dados não requeridos pela autoridade em questão.\r\n6. Dados transmitidos sem solicitação da Meelco Comercial\r\nA Meelco Comercial solicita ao Usuário que não envie à Meelco Comercial quaisquer informações comerciais, criações pessoais, ideias, fotografias, projetos, conceitos, etc (Conteúdos Não Solicitados). Tais Conteúdos Não Solicitados serão sumariamente descartados, sem qualquer leitura ou incorporação às bases de dados da Meelco Comercial. Nos termos da Lei de Direitos Autorais, não são suscetíveis de proteção no Brasil as ideias, concepções abstratas, projetos, planos e esquemas. Desta forma, o eventual uso pela Meelco Comercial de quaisquer Conteúdos Não Solicitados será decorrente de desenvolvimento interno e independente e poderá ocorrer livremente, não sendo devida ou exigida qualquer autorização ou compensação ao usuário ou consumidor. A Meelco Comercial desenvolve de forma independente todas as suas políticas e atividades, rechaçando desde já qualquer acusação ou alegação de aproveitamento de Conteúdos Não Solicitados.\r\n7. Medidas de segurança\r\nRecursos tecnológicos. A Meelco Comercial adota recursos tecnológicos avançados para garantir a segurança de todos os dados pessoais coletados e armazenados. Nem mesmo os funcionários da Meelco Comercial têm livre acesso à base de dados dos Usuários, sendo este limitado apenas àquelas pessoas cujas funções exigem o contato com dados pessoais. Entre as medidas de segurança implementadas, estão a utilização de modernas formas de criptografia e a instalação de barreiras contra o acesso indevido à base de dados (firewalls). Tais medidas podem ser verificadas pelo Usuário acessando o Site pela visualização do “cadeado de segurança” em seu navegador de internet. \r\nSigilo da senha. A Meelco Comercial recomenda que o Usuário mantenha sua senha sob total sigilo, evitando a sua divulgação a terceiros. A Meelco Comercial nunca solicitará ao Usuário que informe sua senha fora do Site, por telefone, e-mail ou por qualquer outro meio de comunicação. A senha do Usuário deverá ser usada exclusivamente no momento do acesso à Conta do Usuário no Site. Caso o Usuário suspeite que sua senha tenha sido exposta a terceiros, a Meelco Comercial recomenda a imediata substituição da senha. \r\nE-mails suspeitos. A Meelco Comercial envia ao Usuário apenas e-mails com mensagens publicitárias, divulgando produtos e serviços ou atualizando informações. A Meelco Comercial não envia mensagens (i) solicitando dados pessoais do Usuário; (ii) solicitando a senha ou dados financeiros do Usuário; (iii) com arquivos anexos exceto documentos em PDF; ou (iv) com links para download de arquivos. Caso receba um e-mail com tais características, desconsidere-o e entre em contato com o CMC (Central de Atendimento Meelco Comercial).\r\nCartões de crédito. A Meelco Comercial não armazena em sua base de dados informações financeiras do Usuário, como as informações referentes a cartões de crédito. O procedimento de aprovação do pagamento ocorre entre o Usuário, os bancos e as administradoras de cartões, sem intervenção da Meelco Comercial.\r\nImpossibilidade de responsabilização. Em que pese os maiores esforços da Meelco Comercial, o atual estágio da tecnologia não permite que se crie uma base de dados absolutamente segura contra ataques. Desta forma, a Meelco Comercial exime-se de qualquer responsabilidade por danos eventualmente causados por terceiros, inclusive por invasões no Site ou na base de dados, por vírus ou por vazamento de informações, a menos que fique comprovada exclusiva culpa da Meelco Comercial.\r\n8. Direitos das pessoas sobre os dados coletados\r\nA Meelco Comercial permite que o Usuário faça diferentes tipos de cadastro, contendo mais ou menos informações de acordo com seu próprio objetivo no Site. Assim, o Usuário tem a possibilidade de escolher a forma de cadastro, devendo preenchê-lo com informações verídicas e atualizadas. O Usuário declara ser o legítimo titular de seus dados pessoais e poderá, a qualquer momento, utilizar as ferramentas do Site para editá-los, atualizá-los ou removê-los preventivamente de nossa base de dados. A Meelco Comercial manterá os dados preventivamente removidos em sigilo pelo prazo de seis meses, para atender obrigações legais de guarda obrigatória, descartando-os definitivamente após tal período. A Meelco Comercial disponibiliza ainda ferramentas para que o Usuário possa determinar alguns usos de seus dados pessoais, como a autorização para envio de peças de publicidade.\r\n9. Uso de dados em caso de alteração de controle da Meelco Comercial\r\nOs dados coletados podem ser eventualmente transferidos a um terceiro em caso de alteração do controle, de uma aquisição, de uma incorporação, de uma fusão ou de uma venda de ativos da Meelco Comercial sob qualquer meio ou forma.\r\n10. Política de dados de menores\r\nO Site não é direcionado a menores de 18 (dezoito) anos. No entanto, o acesso ao Site não é proibido aos menores, uma vez que não há qualquer conteúdo restrito por questões etárias. Os formulários e questionários do site da Meelco Comercial não visam obter dados de menores. Caso tais dados sejam inseridos por menores, seu representante legal poderá contatar o CMC (Central de Atendimento Meelco Comercial) para retificar, modificar ou remover tais dados.\r\n\r\n','2018-08-07 17:28:41','2018-09-10 18:02:56',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Meelco - Quem Somos','one_column',NULL,NULL,'about-porto',NULL,'<br/>\r\n<div class=\"entry-content\">\r\n        <div class=\"row\"><div class=\"row-wrapper container \"><div class=\"row\">\r\n    <div class=\"col-md-12\">\r\n            \r\n            <h2 class=\"word-rotator-title\">\r\n                Um novo caminho para o\r\n        <strong>\r\n            <span class=\"word-rotate\"><span class=\"word-rotate-items\" style=\"top: 0px;\">\r\n                <span>sucesso.</span><span>avanço.</span><span>progresso.</span>\r\n            </span></span>\r\n        </strong>\r\n            </h2>\r\n    </div> \r\n</div></div></div><div class=\"row\"><div class=\"row-wrapper container \"><div class=\"row\">\r\n    <div class=\"col-md-10\">\r\n            \r\n    <p class=\"  lead\">\r\n            Somos uma empresa, consolidada por marcas de referência mundial e regional, Buscando qualificações para nossos clientes, atendendo normas, certificações e para produtos comercializados.\r\n    </p> \r\n    </div> \r\n\r\n    <div class=\"col-md-2\">\r\n            <!--<a class=\"btn btn-primary push-top\" title=\"Junte-se a nós!\" href=\"#\">Join Our Team!</a>-->\r\n\r\n    </div> \r\n</div></div></div><div class=\"row\"><div class=\"row-wrapper container \"><div class=\"row\">\r\n    <div class=\"col-md-12\">\r\n            <hr class=\"tall\"/>\r\n    </div> \r\n</div></div></div><div class=\"row\"><div class=\"row-wrapper container \"><div class=\"row\">\r\n    <div class=\"col-md-8\">\r\n            \r\n            <h3 class=\"\">\r\n                <strong>Nosso</strong> Objetivo\r\n            </h3>\r\n    <p class=\" \">\r\nA Empresa<strong> Meelco</strong> Comercial surge no mercado com uma receita inovadora de atendimento profissionalizado de seus vendedores, onde todos possuem uma vasta bagagem no ramo.<br /> Facilitando ao cliente sua aquisição de produtos corretos de acordo com sua necessidade. A empresa <strong>Meelco</strong> conta Especialista em sistemas elétricos, hidráulicos, ferragens, ferramentas e iluminação em geral. Com uma oferta de produtos que contempla os mais diferentes segmentos.\r\n\r\n<li>Elétrica</li>\r\n<li>Hidráulica</li>\r\n<li>Ferragens</li>\r\n<li>Ferramentas</li>\r\n<li>Iluminação</li>\r\n<li>Outros</li>\r\n    </p> \r\n    </div> \r\n\r\n    <div class=\"col-md-4\">\r\n            \r\n            <div class=\"featured-box\" style=\"height: auto;\"><div class=\"box-content clearboth\">\r\n                <h4>Nossos Valores</h4>\r\n<!--                {{block type=\"core/template\" template=\"socialfeeds/flickrphotos.phtml\"}}-->\r\n<p class=\"\">Você está curioso para saber o que podemos lhe oferecer? Saiba que nossa expectativa é lhe atender.</p>\r\n\r\n            </div></div><!--.featured-box-->\r\n    </div> \r\n</div></div></div><div class=\"row\"><div class=\"row-wrapper container \"><div class=\"row\">\r\n    <div class=\"col-md-12\">\r\n            <hr class=\"tall\"/>\r\n    </div> \r\n</div></div></div><div class=\"row\"><div class=\"row-wrapper container \"><div class=\"row\">\r\n    <div class=\"col-md-12\">\r\n            \r\n            <h3 class=\"push-top\">\r\n                Nossa <strong>Historia</strong>\r\n            </h3>\r\n    </div> \r\n</div></div></div><div class=\"row\"><div class=\"row-wrapper container \" style=\"margin-bottom: 25px;\"><div class=\"row\">\r\n    <div class=\"col-md-12\">\r\n            \r\n            <div class=\"history wow fadeInUp\">\r\n                <div class=\"thumb\"><img width=\"150\" height=\"150\" src=\"{{media url=\"wysiwyg/porto/aboutus/office-1-150x150.jpg\"}}\" class=\"attachment-thumbnail\" alt=\"office-1\"/></div>\r\n                