       stopOnHover: true,\r\n            rewindNav: true,\r\n            rewindSpeed: 600,\r\n            pagination: false,\r\n            navigation: false,\r\n            autoPlay: true,\r\n            navigationText:[\"<i class=\'icon-left-open\'></i>\",\"<i class=\'icon-right-open\'></i>\"]\r\n        });\r\n    });\r\n    \r\n// ]]></script>\r\n</div>','2018-08-07 21:59:33','2018-12-12 21:30:20',1,0,'<reference name=\"head\">\r\n    <action method=\"addJs\"><script>smartwave/jquery/plugins/isotope/packery.pkgd.min.js</script></action>\r\n</reference>','smartwave/porto_child',NULL,NULL,NULL,NULL),(29,'Porto - Homepage RTL','one_column',NULL,NULL,'porto_home_rtl',NULL,'        <h2 class=\"filter-title\" style=\"margin-top:30px;\"><span class=\"content\"><strong>Galaxy phones Just Arrived</strong></span></h2>\n        <div id=\"new_product\" class=\"owl-top-narrow\">\n            {{block type=\"filterproducts/newproduct_home_list\" name=\"new_list\" product_count=\"10\" template=\"filterproducts/list.phtml\"}}\n        </div>\n        <script type=\"text/javascript\">\n        jQuery(function($){\n            $(\"#new_product .filter-products .owl-carousel\").owlCarousel({lazyLoad: true,    itemsCustom: [ [0, 1], [320, 1], [480, 2], [768, 3], [992, 4], [1280, 5] ],    responsiveRefreshRate: 50,    slideSpeed: 200,    paginationSpeed: 500,    scrollPerPage: false,    stopOnHover: true,    rewindNav: true,    rewindSpeed: 600,    pagination: false,    navigation: true,    autoPlay: true,    navigationText:[\"<i class=\'icon-right-open\'></i>\",\"<i class=\'icon-left-open\'></i>\"]});\n        });\n        </script>','2018-08-07 21:59:34','2018-08-07 21:59:34',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(30,'Meelco - Politica de Privacidade','one_column',NULL,NULL,'meelco-politica-de-privacidade','Política de Privacidade','<p>Pol&iacute;tica de Privacidade e Seguran&ccedil;a</p>\r\n<p>O que &eacute; a pol&iacute;tica de privacidade do Portal Meelco Comercial?</p>\r\n<p>Confira! Por: Equipe Meelco Comercial &ndash; Set/2018</p>\r\n<p>A Pol&iacute;tica de Privacidade e Seguran&ccedil;a abaixo constitui parte integrante dos Termos e Condi&ccedil;&otilde;es de Uso.</p>\r\n<p><strong>1. Identifica&ccedil;&atilde;o</strong></p>\r\n<p>Este site &eacute; de propriedade, mantido, e operado por Meelco Comercial Omnichannel Ltda., com endere&ccedil;o na Rua Cel Carlos Oliva, 231, Tatuap&eacute; &ndash; S&atilde;o Paulo - SP, inscrita no CNPJ/MF sob o n&ordm; 26.524.420/0001-60.</p>\r\n<p><strong>2. Contato &ndash; CMC (Central de Atendimento Meelco Comercial) </strong></p>\r\n<p>Caso o Usu&aacute;rio necessite de qualquer informa&ccedil;&atilde;o, esclarecimento ou atendimento com rela&ccedil;&atilde;o a esta Pol&iacute;tica de Privacidade e Seguran&ccedil;a, a Meelco Comercial disponibiliza o CMC para receber todas as comunica&ccedil;&otilde;es que o Usu&aacute;rio desejar fazer. O CMC opera por meios dos canais de comunica&ccedil;&atilde;o listados abaixo: (a) Presencialmente, em qualquer uma das lojas f&iacute;sicas Meelco Comercial, durante os hor&aacute;rios de funcionamento; (b) Pelo telefone 2225-1355, de segunda a s&aacute;bado das 8h &agrave;s 22h e domingos das 9h &agrave;s 20h; (c) Por correspond&ecirc;ncia endere&ccedil;ada &agrave; MEELCO COMERCIAL, Rua Cel Carlos Oliva, 231, Tatuap&eacute; - SP, CEP 03067-010, S&atilde;o Paulo &ndash; SP; (d) Por Email: contato@meelcocomercial.com.br, sempre acompanhada das informa&ccedil;&otilde;es de contato do consumidor, para que possamos finalizar o atendimento. Em todos os casos, o Usu&aacute;rio receber&aacute;, pelo mesmo canal de comunica&ccedil;&atilde;o, uma confirma&ccedil;&atilde;o imediata do recebimento da sua demanda, que ser&aacute; tratada e respondida em um prazo m&aacute;ximo de 5 (cinco) dias. Al&eacute;m disso, a Meelco Comercial disponibiliza neste site uma se&ccedil;&atilde;o de FAQ (Perguntas mais frequentes), bem como suas demais pol&iacute;ticas: Pol&iacute;tica de Trocas e Devolu&ccedil;&otilde;es, Pol&iacute;tica de Pagamentos, Pol&iacute;tica de Entrega de Produtos, Regulamento do Programa Meelco Comercial com Voc&ecirc; e, finalmente, os Termos e Condi&ccedil;&otilde;es de Uso deste Site. Todos estes documentos podem ser consultados online ou baixados pelos usu&aacute;rios em formato PDF para consulta off-line e arquivo.</p>\r\n<p><strong>3. Informa&ccedil;&otilde;es gerais </strong></p>\r\n<p>A Meelco Comercial toma todas as medidas necess&aacute;rias para proteger a privacidade do Usu&aacute;rio, em atendimento &agrave; legisla&ccedil;&atilde;o em vigor. Este documento detalha as formas de coleta, guarda, utiliza&ccedil;&atilde;o, compartilhamento e divulga&ccedil;&atilde;o de seus dados pessoais, bem como aponta claramente as medidas tomadas para assegurar a prote&ccedil;&atilde;o dos dados coletados.</p>\r\n<p><strong>4. Coleta, utiliza&ccedil;&atilde;o e guarda dos dados</strong></p>\r\n<p><strong>Coleta de dados: Conta de Acesso.</strong></p>\r\n<p>Para a cria&ccedil;&atilde;o de uma Conta de Acesso no Site, o Usu&aacute;rio deve preencher um cadastro, que pode variar de complexidade de acordo com as opera&ccedil;&otilde;es que pretende fazer. Desta forma, um cadastro simples composto de endere&ccedil;o de e-mail e CEP ser&aacute; requerido para o envio de mensagens publicit&aacute;rias e promocionais ao Usu&aacute;rio sobre produtos, servi&ccedil;os, promo&ccedil;&otilde;es e/ou novidades da Meelco Comercial. Uma Conta de Acesso b&aacute;sica poder&aacute; ser feita pelo Usu&aacute;rio a qualquer momento, para inscri&ccedil;&otilde;es em cursos, por exemplo, mediante preenchimento de formul&aacute;rio contendo nome completo, endere&ccedil;o de e-mail, n&uacute;mero de telefone, CEP, sexo, documento de identidade, CPF e cria&ccedil;&atilde;o de uma senha. Para a realiza&ccedil;&atilde;o de Compras e participa&ccedil;&atilde;o no Programa Meelco Comercial com Voc&ecirc;, o Usu&aacute;rio dever&aacute; criar uma Conta de Acesso completa, fornecendo nome completo, endere&ccedil;o de e-mail, n&uacute;mero de telefone, CPF, endere&ccedil;o completo (estado, cidade, bairro, rua, n&uacute;mero, complemento, informa&ccedil;&otilde;es extras). Os dados fornecidos pelos Usu&aacute;rios ser&atilde;o armazenados e utilizados pela Meelco Comercial, por si ou por terceiros por ela contratados, para fornecer os produtos do Site, realizar as transa&ccedil;&otilde;es comerciais, processar pagamentos a elas relacionados, compartilhar dados, enviar e-mails de ofertas, produtos, servi&ccedil;os e campanhas de marketing, armazenar o hist&oacute;rico de produtos visualizados, promover campanhas de retargeting, personalizar p&aacute;ginas do Site, verificar dados banc&aacute;rios para evitar fraudes (dados n&atilde;o ser&atilde;o armazenados), realizar entregas e devolu&ccedil;&atilde;o e programar a&ccedil;&otilde;es e benef&iacute;cios do Programa Meelco Comercial com Voc&ecirc;. Os dados poder&atilde;o ser compartilhados com terceiros contratados pela Meelco Comercial nos termos desta Pol&iacute;tica, ressaltando-se que a cria&ccedil;&atilde;o de cada Conta de Acesso ou qualquer cadastro no Site, para o qual seja necess&aacute;rio o envio de qualquer dado pessoal do Usu&aacute;rio, pressup&otilde;e o consentimento expresso quanto &agrave; coleta, uso, armazenamento e tratamento de dados pessoais. O Usu&aacute;rio &eacute; respons&aacute;vel, nas esferas civil e criminal, pela veracidade e atualiza&ccedil;&atilde;o dos dados fornecidos (inclusive os dados pessoais) e a Meelco Comercial se exime de qualquer reponsabilidade por danos decorrentes do reenchimento incompleto, impreciso ou inexato do cadastro pelo Usu&aacute;rio, sob qualquer meio ou forma, ou, ainda, pelo uso desse cadastro de forma indevida por qualquer terceiro n&atilde;o autorizado a usar tais dados ou, ainda, por terceiros que tenham, devida ou indevidamente, obtido os dados do Usu&aacute;rio para acesso no Site, agindo como se ele fosse.</p>\r\n<p><strong>Coleta de dados: Cookies. </strong></p>\r\n<p>Visando oferecer a melhor experi&ecirc;ncia de navega&ccedil;&atilde;o e Compras ao Usu&aacute;rio, a Meelco Comercial utiliza-se de tecnologias para coletar e armazenar informa&ccedil;&otilde;es relacionadas &agrave; visita do Usu&aacute;rio no Site e isso pode incluir o envio de um ou mais cookies ou identificadores an&ocirc;nimos que coletam dados relativos &agrave;s prefer&ecirc;ncias de navega&ccedil;&atilde;o e &agrave;s p&aacute;ginas visitadas pelo Usu&aacute;rio. Desta forma, a apresenta&ccedil;&atilde;o do Site fica personalizada e alinhada aos interesses pessoais do Usu&aacute;rio e a Meelco Comercial fica em condi&ccedil;&atilde;o de elaborar ofertas e benef&iacute;cios do Programa Meelco Comercial com Voc&ecirc; de forma personalizada. A utiliza&ccedil;&atilde;o destes dados fica restrita aos objetivos indicados e a Meelco Comercial se compromete a n&atilde;o utilizar ou permitir a utiliza&ccedil;&atilde;o de tais dados com outra finalidade. Ademais, a coleta, guarda e tratamento destes dados &eacute; absolutamente automatizada, n&atilde;o havendo nenhuma possibilidade de contato humano com os dados em quest&atilde;o. O Usu&aacute;rio pode e poder&aacute;, a qualquer tempo, caso discorde da pol&iacute;tica de cookies acima, utilizar as ferramentas de seu navegador que impedem a instala&ccedil;&atilde;o de cookies e ainda apagar quaisquer cookies existentes em seu dispositivo de conex&atilde;o com a internet. Neste caso, &eacute; poss&iacute;vel que haja falhas em algumas funcionalidades do Site e na sele&ccedil;&atilde;o de benef&iacute;cios do Programa Meelco Comercial com Voc&ecirc;. A Meelco Comercial poder&aacute; ainda utilizar-se de outras tecnologias para a coleta de dados de navega&ccedil;&atilde;o dos Usu&aacute;rios, comprometendo-se a guard&aacute;-los, trat&aacute;-los e utiliz&aacute;-los em conformidade com este Pol&iacute;tica.</p>\r\n<p><strong>Coleta de dados: Registros de acesso. </strong></p>\r\n<p>A Meelco Comercial manter&aacute; em sua base de dados todas as informa&ccedil;&otilde;es relativas aos acessos do Usu&aacute;rio ao Site, incluindo, mas n&atilde;o se limitando ao endere&ccedil;o IP, &agrave;s p&aacute;ginas acessadas, aos hor&aacute;rios e datas de acesso, e o dispositivo de acesso utilizado, nos termos da legisla&ccedil;&atilde;o vigente. Tais registros poder&atilde;o ser utilizados em investiga&ccedil;&otilde;es internas ou p&uacute;blicas para averigua&ccedil;&atilde;o de pr&aacute;ticas que possam gerar quaisquer preju&iacute;zos &agrave; Meelco Comercial, inclusive a pr&aacute;tica de crimes em ambientes virtuais.</p>\r\n<p><strong>Coleta de dados: Outras formas. </strong></p>\r\n<p>A Meelco Comercial poder&aacute; coletar dados pessoais do Usu&aacute;rio, que n&atilde;o os identificados aqui, que sejam inseridos pelo Usu&aacute;rio e sobre o Usu&aacute;rio voluntariamente no processo de navega&ccedil;&atilde;o do Site ou quando entrar em contato com o CMC (Central de Atendimento Meelco Comercial). Finalmente, a Meelco Comercial poder&aacute; acessar bases de dados p&uacute;blicas ou privadas para confirmar a veracidade dos dados pessoais informados pelo Usu&aacute;rio, inclusive dados relacionados ao pagamento da Compra.</p>\r\n<p><strong>Utiliza&ccedil;&atilde;o de dados: E-mail.</strong></p>\r\n<p>A Meelco Comercial utilizar&aacute; o e-mail do Usu&aacute;rio prioritariamente para enviar informa&ccedil;&otilde;es sobre suas Compras (confirma&ccedil;&atilde;o de Compra e atualiza&ccedil;&otilde;es da situa&ccedil;&atilde;o). O e-mail cadastrado tamb&eacute;m ser&aacute; utilizado para comunica&ccedil;&atilde;o relacionada aos cursos em que o Cliente estiver inscrito, para informa&ccedil;&otilde;es relativas ao Programa Meelco Comercial com Voc&ecirc; e para recupera&ccedil;&atilde;o da senha de acesso do Cliente, em caso de perda ou esquecimento da senha.</p>\r\n<p><strong>Utiliza&ccedil;&atilde;o de dados: </strong></p>\r\n<p>Publicidade via mala direta, e-mail, MMS ou SMS. No momento do cadastro de seus dados de contato, o Usu&aacute;rio ter&aacute; a op&ccedil;&atilde;o de aceitar ou proibir o envio de mensagens publicit&aacute;rias (incluindo mensagens relativas ao Programa Meelco Comercial com Voc&ecirc;). Ademais, a qualquer momento, o Usu&aacute;rio poder&aacute; alterar sua decis&atilde;o, por meio de acesso &agrave; sua Conta no Site ou de contato com o CMC (Central de Atendimento Meelco Comercial) ou, ainda, no campo de descadastro existente nas newsletters enviadas pela Meelco Comercial, sendo que nesse caso o descadastramento da base de dados poder&aacute; demorar at&eacute; 5 (cinco) dias para ser efetivada.</p>\r\n<p><strong>Utiliza&ccedil;&atilde;o dos dados: Outras formas. </strong></p>\r\n<p>Al&eacute;m das formas expostas acima, a Meelco Comercial poder&aacute;, a seu exclusivo crit&eacute;rio, utilizar os dados pessoais do Usu&aacute;rio nas seguintes formas: (i) atualiza&ccedil;&atilde;o de cadastro; (ii) garantia da seguran&ccedil;a do Usu&aacute;rio; (iii) resposta a solicita&ccedil;&otilde;es do pr&oacute;prio Usu&aacute;rio; (iv) informa&ccedil;&atilde;o acerca de altera&ccedil;&otilde;es nos Termos e Condi&ccedil;&otilde;es de Uso ou das Pol&iacute;ticas; (v) elabora&ccedil;&atilde;o de estat&iacute;sticas com rela&ccedil;&atilde;o ao uso do Site, garantido o anonimato do Usu&aacute;rio, inclusive para fins de aperfei&ccedil;oamento e entendimento do perfil dos Usu&aacute;rios para a melhoria do Site; (vi) aperfei&ccedil;oamento de ferramentas de interatividade entre o Site e o Usu&aacute;rio, garantido seu anonimato; (vii) cumprimento de ordens judiciais; e (viii) defesa dos direitos da Meelco Comercial contra o Usu&aacute;rio em procedimentos judiciais ou administrativos.</p>\r\n<p><strong>Guarda dos dados.</strong></p>\r\n<p>A Meelco Comercial guardar&aacute; todos os dados coletados em suas bases de dados protegidas e seguras. Tais dados ser&atilde;o acessados apenas por processos computadorizados automatizados, profissionais autorizados e nos casos listados nesta Pol&iacute;tica. Caso o Usu&aacute;rio requeira a exclus&atilde;o de seus dados da base de dados, a Meelco Comercial se reserva o seu direito de manter os dados em quest&atilde;o em c&oacute;pias de salvaguarda por at&eacute; 6 (seis) meses, a fim de cumprir obriga&ccedil;&otilde;es legais de guarda obrigat&oacute;ria.</p>\r\n<p><strong>5. Compartilhamento e divulga&ccedil;&atilde;o dos dados </strong></p>\r\n<p>A Meelco Comercial tem a confidencialidade dos dados pessoais do Usu&aacute;rio como prioridade em seus neg&oacute;cios. Assim, assume o compromisso de n&atilde;o divulgar, compartilhar, dar acesso a, facilitar acesso a, alugar, vender, trocar ou de qualquer outra forma disponibilizar tais informa&ccedil;&otilde;es a terceiros, sob nenhum pretexto, exceto nos casos autorizados expressamente pelo Usu&aacute;rio, inclusive nos casos indicados abaixo. Com o &uacute;nico intuito de permitir a concretiza&ccedil;&atilde;o de Compras no Site, a Meelco Comercial poder&aacute; compartilhar dados pessoais dos Usu&aacute;rios com seus parceiros comerciais, como empresas processadoras de pagamentos, administradoras de cart&atilde;o de cr&eacute;dito e transportadoras. Neste caso, ser&atilde;o compartilhados apenas os dados pessoais imprescind&iacute;veis para que o parceiro comercial da Meelco Comercial desempenhe sua atividade (cobran&ccedil;a, entrega, etc.). Ademais, tais parceiros comerciais ser&atilde;o obrigados, por meio de contratos de confidencialidade, a n&atilde;o arquivar, manter em arquivo, compilar, copiar, reproduzir ou compartilhar tais dados com quem quer que seja. A outra hip&oacute;tese de divulga&ccedil;&atilde;o de dados pessoais &eacute; por meio de uma determina&ccedil;&atilde;o judicial. Tamb&eacute;m neste caso, a divulga&ccedil;&atilde;o ocorrer&aacute; apenas na medida necess&aacute;ria para cumprir a determina&ccedil;&atilde;o judicial, permanecendo sigilosos os dados n&atilde;o requeridos pela autoridade em quest&atilde;o.</p>\r\n<p><strong>6. Dados transmitidos sem solicita&ccedil;&atilde;o da Meelco Comercial </strong></p>\r\n<p>A Meelco Comercial solicita ao Usu&aacute;rio que n&atilde;o envie &agrave; Meelco Comercial quaisquer informa&ccedil;&otilde;es comerciais, cria&ccedil;&otilde;es pessoais, ideias, fotografias, projetos, conceitos, etc (Conte&uacute;dos N&atilde;o Solicitados). Tais Conte&uacute;dos N&atilde;o Solicitados ser&atilde;o sumariamente descartados, sem qualquer leitura ou incorpora&ccedil;&atilde;o &agrave;s bases de dados da Meelco Comercial. Nos termos da Lei de Direitos Autorais, n&atilde;o s&atilde;o suscet&iacute;veis de prote&ccedil;&atilde;o no Brasil as ideias, concep&ccedil;&otilde;es abstratas, projetos, planos e esquemas. Desta forma, o eventual uso pela Meelco Comercial de quaisquer Conte&uacute;dos N&atilde;o Solicitados ser&aacute; decorrente de desenvolvimento interno e independente e poder&aacute; ocorrer livremente, n&atilde;o sendo devida ou exigida qualquer autoriza&ccedil;&atilde;o ou compensa&ccedil;&atilde;o ao usu&aacute;rio ou consumidor. A Meelco Comercial desenvolve de forma independente todas as suas pol&iacute;ticas e atividades, recha&ccedil;ando desde j&aacute; qualquer acusa&ccedil;&atilde;o ou alega&ccedil;&atilde;o de aproveitamento de Conte&uacute;dos N&atilde;o Solicitados.</p>\r\n<p><strong>7. Medidas de seguran&ccedil;a Recursos tecnol&oacute;gicos. </strong></p>\r\n<p>A Meelco Comercial adota recursos tecnol&oacute;gicos avan&ccedil;ados para garantir a seguran&ccedil;a de todos os dados pessoais coletados e armazenados. Nem mesmo os funcion&aacute;rios da Meelco Comercial t&ecirc;m livre acesso &agrave; base de dados dos Usu&aacute;rios, sendo este limitado apenas &agrave;quelas pessoas cujas fun&ccedil;&otilde;es exigem o contato com dados pessoais. Entre as medidas de seguran&ccedil;a implementadas, est&atilde;o a utiliza&ccedil;&atilde;o de modernas formas de criptografia e a instala&ccedil;&atilde;o de barreiras contra o acesso indevido &agrave; base de dados (firewalls). Tais medidas podem ser verificadas pelo Usu&aacute;rio acessando o Site pela visualiza&ccedil;&atilde;o do &ldquo;cadeado de seguran&ccedil;a&rdquo; em seu navegador de internet.</p>\r\n<p><strong>Sigilo da senha. </strong></p>\r\n<p>A Meelco Comercial recomenda que o Usu&aacute;rio mantenha sua senha sob total sigilo, evitando a sua divulga&ccedil;&atilde;o a terceiros. A Meelco Comercial nunca solicitar&aacute; ao Usu&aacute;rio que informe sua senha fora do Site, por telefone, e-mail ou por qualquer outro meio de comunica&ccedil;&atilde;o. A senha do Usu&aacute;rio dever&aacute; ser usada exclusivamente no momento do acesso &agrave; Conta do Usu&aacute;rio no Site. Caso o Usu&aacute;rio suspeite que sua senha tenha sido exposta a terceiros, a Meelco Comercial recomenda a imediata substitui&ccedil;&atilde;o da senha.</p>\r\n<p><strong>E-mails suspeitos. </strong></p>\r\n<p>A Meelco Comercial envia ao Usu&aacute;rio apenas e-mails com mensagens publicit&aacute;rias, divulgando produtos e servi&ccedil;os ou atualizando informa&ccedil;&otilde;es. A Meelco Comercial n&atilde;o envia mensagens (i) solicitando dados pessoais do Usu&aacute;rio; (ii) solicitando a senha ou dados financeiros do Usu&aacute;rio; (iii) com arquivos anexos exceto documentos em PDF; ou (iv) com links para download de arquivos. Caso receba um e-mail com tais caracter&iacute;sticas, desconsidere-o e entre em contato com o CMC (Central de Atendimento Meelco Comercial).</p>\r\n<p><strong>Cart&otilde;es de cr&eacute;dito.</strong></p>\r\n<p>A Meelco Comercial n&atilde;o armazena em sua base de dados informa&ccedil;&otilde;es financeiras do Usu&aacute;rio, como as informa&ccedil;&otilde;es referentes a cart&otilde;es de cr&eacute;dito. O procedimento de aprova&ccedil;&atilde;o do pagamento ocorre entre o Usu&aacute;rio, os bancos e as administradoras de cart&otilde;es, sem interven&ccedil;&atilde;o da Meelco Comercial.</p>\r\n<p><strong>Impossibilidade de responsabiliza&ccedil;&atilde;o. </strong></p>\r\n<p>Em que pese os maiores esfor&ccedil;os da Meelco Comercial, o atual est&aacute;gio da tecnologia n&atilde;o permite que se crie uma base de dados absolutamente segura contra ataques. Desta forma, a Meelco Comercial exime-se de qualquer responsabilidade por danos eventualmente causados por terceiros, inclusive por invas&otilde;es no Site ou na base de dados, por v&iacute;rus ou por vazamento de informa&ccedil;&otilde;es, a menos que fique comprovada exclusiva culpa da Meelco Comercial.</p>\r\n<p><strong>8. Direitos das pessoas sobre os dados coletados </strong></p>\r\n<p>A Meelco Comercial permite que o Usu&aacute;rio fa&ccedil;a diferentes tipos de cadastro, contendo mais ou menos informa&ccedil;&otilde;es de acordo com seu pr&oacute;prio objetivo no Site. Assim, o Usu&aacute;rio tem a possibilidade de escolher a forma de cadastro, devendo preench&ecirc;-lo com informa&ccedil;&otilde;es ver&iacute;dicas e atualizadas. O Usu&aacute;rio declara ser o leg&iacute;timo titular de seus dados pessoais e poder&aacute;, a qualquer momento, utilizar as ferramentas do Site para edit&aacute;-los, atualiz&aacute;-los ou remov&ecirc;-los preventivamente de nossa base de dados. A Meelco Comercial manter&aacute; os dados preventivamente removidos em sigilo pelo prazo de seis meses, para atender obriga&ccedil;&otilde;es legais de guarda obrigat&oacute;ria, descartando-os definitivamente ap&oacute;s tal per&iacute;odo. A Meelco Comercial disponibiliza ainda ferramentas para que o Usu&aacute;rio possa determinar alguns usos de seus dados pessoais, como a autoriza&ccedil;&atilde;o para envio de pe&ccedil;as de publicidade.</p>\r\n<p><strong>9. Uso de dados em caso de altera&ccedil;&atilde;o de controle da Meelco Comercial </strong></p>\r\n<p>Os dados coletados podem ser eventualmente transferidos a um terceiro em caso de altera&ccedil;&atilde;o do controle, de uma aquisi&ccedil;&atilde;o, de uma incorpora&ccedil;&atilde;o, de uma fus&atilde;o ou de uma venda de ativos da Meelco Comercial sob qualquer meio ou forma.</p>\r\n<p><strong>10. Pol&iacute;tica de dados de menores</strong></p>\r\n<p>O Site n&atilde;o &eacute; direcionado a menores de 18 (dezoito) anos. No entanto, o acesso ao Site n&atilde;o &eacute; proibido aos menores, uma vez que n&atilde;o h&aacute; qualquer conte&uacute;do restrito por quest&otilde;es et&aacute;rias. Os formul&aacute;rios e question&aacute;rios do site da Meelco Comercial n&atilde;o visam obter dados de menores. Caso tais dados sejam inseridos por menores, seu representante legal poder&aacute; contatar o CMC (Central de Atendimento Meelco Comercial) para retificar, modificar ou remover tais dados.</p>','2018-09-10 18:04:58','2018-12-12 21:35:04',1,0,NULL,'smartwave/porto_child',NULL,NULL,NULL,NULL),(31,'Meelco - Politica Comercial','one_column',NULL,NULL,'meelco-politica-comercial','Política Comercial','<h1>Termos e Condições de Uso do Site</h1>\r\n<p>Confira nosso Termos e Condições de Uso do Site.</p>\r\n<div>\r\n  <div>\r\n    <h2>Sumário</h2>\r\n    <p><strong>1.</strong> Apresentação e definições <br>\r\n      <strong>2.</strong> Regras de utilização do site<br>\r\n      <strong>3.</strong> Cadastro de Clientes<br>\r\n      <strong>4</strong>. Programa Meelco Comercial com Você <br>\r\n      <strong>5.</strong> Dados pessoais, privacidade e segurança<br>\r\n      <strong>6.</strong> Oferta de produtos<br>\r\n      <strong>7.</strong> Estoque<br>\r\n      <strong>8.</strong> Promoções<br>\r\n      <strong>9.</strong> Pagamento<br>\r\n      <strong>10.</strong> Preço<br>\r\n      <strong>11.</strong> Acompanhamento da Compra<br>\r\n      <strong>12.</strong> Entrega<br>\r\n      <strong>13.</strong> Arrependimento, trocas e devoluções<br>\r\n      <strong>14.</strong> Garantias<br>\r\n      <strong>15.</strong> Responsabilidades<br>\r\n      <strong>16.</strong> Links para outros websites<br>\r\n      <strong>17.</strong> Aplicações de Internet ou vírus de computador<br>\r\n      <strong>18.</strong> Direitos de Propriedade Intelectual<br>\r\n      <strong>19.</strong> Comunicações e CMC<br>\r\n      <strong>20.</strong> Duração<br>\r\n      <strong>21.</strong> Atualizações destes Termos e Condições<br>\r\n      <strong>22.</strong> Registro Público<br>\r\n      <strong>23.</strong> Idioma<br>\r\n      <strong>24.</strong> Diversos<br>\r\n      <strong>25.</strong> Lei aplicável e Foro de Eleição<br>\r\n    </p>\r\n    <h2>1.Apresentação e definições</h2>\r\n    <p>Este site é de propriedade, mantido, e operado por Meelco Comercial Omnichannel Ltda., com endereço na Rua Cel Carlos Oliva, 231, Tatuapé – São Paulo - SP, inscrita no CNPJ/MF sob o nº 26.524.420/0001-60. e endereço de e-mail contato@meelcocomercial.com.br. <strong>Este documento relaciona os termos e condições que devem ser observados pela Meelco Comercial e pelos Usuários (conforme definição abaixo) na utilização do Site, de suas ferramentas e de suas funcionalidades</strong>. A Meelco Comercial faculta acesso e utilização do Site a quaisquer Usuários. O Usuário declara ter lido e aceito estes Termos e Condições de Uso e das Políticas antes de ter iniciado a utilização do Site. Caso o Usuário não aceite estes Termos e Condições de Uso, não lhe será permitido acesso a áreas restritas do Site. Para os fins destes Termos e Condições de Uso, bem como das Políticas, os termos abaixo terão os seguintes significados: CMC. Central de Atendimento Meelco Comercial é o serviço de atendimento ao consumidor disponibilizado pela Meelco Comercial por meio de diversos canais de comunicação, indicados em cada uma das Políticas e no item 18 destes Termos e Condições de Uso;</p>\r\n    <p><strong>Clientes</strong>. Usuários que preencheram o cadastro e detêm uma Conta de Acesso; <strong>Compra</strong>. Transação por meio da qual um Cliente adquire um produto oferecido à venda no Site, mediante a realização de pagamento do valor do produto; <strong>Conta de Acesso</strong>. Credencial definida pelo nome de usuário (login) e senha de um visitante cadastrado (Cliente), pessoal e intransferível, que permite acesso à área restrita e as funcionalidades exclusivas no Site, tais como acesso e alteração de dados pessoais, inscrição e cancelamento de participação em cursos, criação, edição e remoção de listas de desejos, entre outras; <strong>Meelco Comercial</strong>. A Meelco Comercial Omnichannel Ltda; <strong>Marca</strong>. Quaisquer sinais distintivos de titularidade da e/ou licenciados à Meelco Comercial, que sejam utilizados na identificação do Site, de seu conteúdo ou de serviço prestado pela Meelco Comercial. <strong>Políticas</strong>. As políticas que complementam e integram estes Termos e Condições de Uso, nominalmente <strong><a href=\"#\">Política de Trocas e Devoluções</a></strong>, <strong><a href=\"#\" title=\"Confira nossa Política de Pagamentos\">Política de Pagamentos</a></strong>, <strong><a href=\"#\">Política de Entrega de Produtos</a></strong> e a <strong><a href=\"#\" title=\"Confira nossa Política de Privacidade e Segurança\">Política de Privacidade e Segurança</a></strong>, todas disponíveis no Site; <strong>Propriedade Intelectual da Meelco Comercial</strong>. Todos os bens de propriedade intelectual de titularidade da Meelco Comercial, de qualquer empresa pertencente a seu grupo econômico, ou, ainda, de terceiro, cujo uso seja licenciado e/ou autorizado à Meelco Comercial, incluindo mas não se limitando a Marcas, patentes, invenções ou modelos de utilidade, desenhos industriais, know-how, segredos de negócio, ilustrações, fotografias e/ou conteúdos de qualquer tela do Site ou quaisquer obras intelectuais ou outros conteúdos que estejam inseridos em qualquer obra intelectual ou qualquer bem protegido por direitos de propriedade intelectual. <strong>Site.</strong> O website de propriedade, mantido e operado por Meelco Comercial, hospedado no domínio [leroymerlin.com.br] e todas as páginas nele compreendidas; e<strong>Usuários.</strong> Quaisquer pessoas que acessem o Site, incluindo visitantes anônimos e Clientes.</p>\r\n    <h2>2.Regras de utilização do Site</h2>\r\n    <p>O Usuário obriga-se a utilizar o Site respeitando e observando estes Termos e Condições de Uso, bem como a legislação vigente, os costumes e a ordem pública. Desta forma, o Usuário concorda que não poderá: (i) lesar direitos de terceiros, independentemente de sua natureza, em qualquer momento, inclusive no decorrer do uso do Site; (ii) executar atos que limitem ou impeçam o acesso e a utilização do Site, em condições adequadas, aos demais Usuários; (iii) acessar ilicitamente o Site ou sistemas informáticos de terceiros relacionados ao Site ou à Meelco Comercial sob qualquer meio ou forma; (iv) difundir programas ou vírus informáticos suscetíveis de causar danos de qualquer natureza, inclusive em equipamentos e sistemas da Meelco Comercial ou de terceiros; (v) utilizar mecanismos que não os expressamente habilitados ou recomendados no Site para obtenção de informações, conteúdos e serviços; (vi) realizar quaisquer atos que de alguma forma possam implicar qualquer prejuízo ou dano à Meelco Comercial ou a outros Usuários; (vii) acessar áreas de programação do Site, bases de dados ou qualquer outro conjunto de informações que escape às áreas públicas ou restritas do Site; (viii) realizar ou permitir engenharia reversa, traduzir, modificar, alterar a linguagem, compilar, decompilar, modificar, reproduzir, alugar, sublocar, divulgar, transmitir, distribuir, usar ou, de outra maneira, dispor do Site ou das ferramentas e funcionalidades nele disponibilizadas sob qualquer meio ou forma, inclusive de modo a violar direitos da Meelco Comercial (inclusive de Propriedade Intelectual da Meelco Comercial) e/ou de terceiros; (ix) praticar ou participar de qualquer ato que constitua uma violação de qualquer direito da Meelco Comercial (inclusive de Propriedade Intelectual da Meelco Comercial) ou de terceiros ou ainda de qualquer lei aplicável, ou agir sob qualquer meio ou forma que possa contribuir com tal violação; (x) interferir na segurança ou cometer usos indevidos contra o Site ou qualquer recurso do sistema, rede ou serviço conectado ou que possa ser acessado por meio do Site, devendo acessar o Site apenas para fins lícitos e autorizados; (xi) utilizar o domínio da Meelco Comercial para criar links ou atalhos a serem disponibilizados em e-mails não solicitados (mensagens spam) ou em websites de terceiros ou do próprio Usuário ou, ainda, para realizar qualquer tipo de ação que possa vir a prejudicar a Meelco Comercial ou terceiros; (xii) utilizar aplicativos automatizados de coleta e seleção de dados para realizar operações massificadas ou para quaisquer finalidades ou, ainda, para coletar e transferir quaisquer dados que possam ser extraídos do Site para fins não permitidos ou ilícitos, (xiii) utilizar as ferramentas e funcionalidades do Site para difundir mensagens não relacionadas com o Site ou com as finalidades do Site, incluindo mensagens de cunho racista, étnico, político, religioso, cultural ou depreciativo, difamatório e/ou calunioso de qualquer pessoa ou grupo social. O Usuário concorda em indenizar, defender e isentar a Meelco Comercial de qualquer reclamação, notificação, intimação ou ação judicial ou extrajudicial, ou ainda de qualquer responsabilidade, dano, custo ou despesa decorrente de qualquer violação e/ou infração cometida pelo Usuário ou qualquer pessoa agindo em seu nome, com seu consentimento ou tolerância, em relação ao Site (inclusive com relação a qualquer disposição destes Termos e Condições de Uso), inclusive qualquer pessoa que tenha obtido os dados do Usuário relacionados a sua Conta de Acesso ou a sua navegação no Site. A Meelco Comercial poderá, a seu exclusivo critério, bloquear, restringir, desabilitar ou impedir o acesso de qualquer Usuário ao Site, total ou parcialmente, sem qualquer aviso prévio, sempre que for detectada uma conduta inadequada do Usuário, sem prejuízo das medidas administrativas, extrajudiciais e judiciais que julgar convenientes.</p>\r\n    <h2>3.Cadastro de Clientes</h2>\r\n    <p>Para obter acesso ao conteúdo completo e a todas as ferramentas e funcionalidades do Site, incluindo a possibilidade de efetuar Compras, o Usuário deverá criar uma Conta com dados pessoais, os quais serão armazenados e utilizados para identificação das Compras, a serem usados nos termos da Política de Privacidade e Segurança, ressaltando-se que a criação de cada Conta pressupõe o consentimento expresso sobre coleta, uso, armazenamento e tratamento de dados pessoais pela Meelco Comercial e/ou por terceiros por ela contratados para realizar qualquer</p>\r\n    <p>procedimento ou processo relacionado às Compras, inclusive processamento de pagamentos, entregas, devoluções etc.. A cada Cliente é permitida a criação de apenas uma Conta de Acesso e a Meelco Comercial se reserva o direito de suspender ou cancelar quaisquer Contas de Acesso em duplicidade. Ao completar a sua Conta de Acesso, o Cliente declara que as informações fornecidas são completas, verdadeiras, atuais e precisas, sendo de total responsabilidade do Cliente a atualização dos dados de sua Conta de Acesso sempre que houver modificação de nome, endereço ou qualquer outra informação relevante. A Meelco Comercial poderá recusar, suspender ou cancelar a Conta de Acesso de um Cliente sempre que suspeitar que as informações fornecidas são falsas, incompletas, desatualizadas ou imprecisas ou ainda nos casos indicados nas leis e regulamentos aplicáveis, nestes Termos e Condições ou em qualquer Política do Site, mesmo que previamente aceito. O Cliente, no momento da criação de sua Conta de Acesso, determinará seu nome de usuário e sua senha de acesso. É de exclusiva responsabilidade do Cliente a manutenção do sigilo do nome de usuário e/ou da senha de acesso relativos à sua Conta de Acesso, devendo o Cliente comunicar imediatamente a Meelco Comercial em caso de perda, divulgação ou roubo da senha ou ainda de uso não autorizado de sua Conta. Menores (idade inferior a 18 anos) não poderão utilizar o Site, a menos que sejam representados e/ou assistidos por seus pais ou responsáveis legais e por estes autorizados no momento da criação da Conta. A efetivação de uma Conta em nome de um menor pressupõe a representação deste menor por uma pessoa maior de 18 anos, que será reputada responsável civil e criminalmente por qualquer Compra realizada, violação cometida ou declaração falsa, incompleta, desatualizada ou imprecisa prestada pelo menor de 18 anos.</p>\r\n    <h2>4. Programa Meelco Comercial com Você</h2>\r\n    <p>A Meelco Comercial criou e mantém um programa de relacionamento com os Clientes chamado Meelco Comercial com Você. Este programa se opera de acordo com o Regulamento do Programa Meelco Comercial com Você, que integra inseparavelmente estes Termos e Condições de Uso.</p>\r\n    <h2>5.Dados pessoais, privacidade e segurança</h2>\r\n    <p>A Meelco Comercial dispõe de uma política específica para regular a coleta, guarda e utilização de dados pessoais, bem como a sua segurança: Política de Privacidade e Segurança. Essa política específica integra inseparavelmente estes Termos e Condições de Uso, ressaltando-se que os dados de utilização do Site serão arquivados nos termos da legislação em vigor.</p>\r\n    <h2>6.Oferta de produtos</h2>\r\n    <p>Informações. A Meelco Comercial disponibilizará no Site, para cada produto, uma página descritiva, da qual constarão informações relativas às suas características, composição, eventuais riscos que possa oferecer à saúde e à segurança, prazo de validade, origem, disponibilidade em estoque, condições de pagamento e preço total à vista. Território. O Site tem ferramentas de geolocalização manuais (por meio de informação prestada pelo próprio Usuário) e automáticas (por meio de cookies) que determinam o conteúdo a ser apresentado para cada usuário. No entanto, em virtude de limitações de tais ferramentas, é possível que o Usuário acesse conteúdo (oferta de produtos, inclusive) direcionado a uma zona geográfica diferente daquela onde está localizado. <strong>Em qualquer caso, a oferta de produtos será sempre limitada ao território em que a Meelco Comercial disponibiliza entrega, nos termos do item 3 da Política de Entrega de Produtos, não sendo válida para as localidades não incluídas neste território.</strong> A Meelco Comercial poderá, a seu exclusivo critério, alterar este território, incluindo ou excluindo localidades. Em caso de dúvida, o usuário poderá consultar a Política de Entrega de Produtos ou entrar em contato com o CMC (Central de Atendimento Meelco Comercial).</p>\r\n    <h2>7.Estoque</h2>\r\n    <p>A Meelco Comercial possui uma grande quantidade de itens cadastrados no Site. Por motivos alheios à vontade e ao controle da Meelco Comercial, é possível que alguns destes itens fiquem temporariamente indisponíveis, em virtude de peculiaridades, sazonalidades ou problemas na cadeia de fornecimento. A Meelco Comercial compromete-se a engajar seus melhores esforços para manter a disponibilidade da maior quantidade possível de itens. Observamos ainda que o Site e as lojas físicas da Meelco Comercial possuem estoques separados, sendo possível que um item indisponível no site esteja disponível em uma loja física e vice-versa. Em caso de Compra de um produto indisponível em estoque por falha na atualização do Site, a Meelco Comercial entrará em contato com o Cliente visando à imediata solução do problema, pelo reembolso do valor pago, pela escolha de produto equivalente ou pela determinação de aguardar a disponibilidade do produto.</p>\r\n    <h2>8.Promoções</h2>\r\n    <p><strong>Realização.</strong> A Meelco Comercial poderá, a qualquer momento, por motivos puramente comerciais e a seu exclusivo critério, criar e manter campanhas promocionais, oferecendo determinados produtos a preços inferiores aos usualmente praticados ou com a incidência de descontos. <strong>Condições.</strong> As promoções não serão cumulativas e poderão ser limitadas: (i) a uma determinada quantidade de produtos em promoção; (ii) a um determinado período de tempo; (iii) a aceitação de condições especiais, como a impossibilidade de troca do produto. As condições de validade das promoções serão claramente veiculadas por todos os meios de divulgação das promoções e a Meelco Comercial recomenda a sua atenta leitura pelo Usuário. Em caso de dúvidas, o Usuário pode entrar em contato com o CMC (Central de Atendimento Meelco Comercial). <strong>Lojas físicas.</strong>As condições de promoções para produtos do Site podem não ser aplicáveis para produtos vendidos pela Meelco Comercial nas lojas físicas. Em caso de dúvidas, o Usuário pode entrar em contato com o CMC (Central de Atendimento Meelco Comercial).<strong>Território.</strong> As promoções para Compras no Site serão restritas ao território em que a Meelco Comercial disponibiliza entrega, nos termos do item 3 da Política de Entrega de Produtos, não sendo válida para as localidades não incluídas neste território. <strong>Trocas.</strong> Nos casos de trocas (quando autorizadas pelas condições da promoção) ou devoluções de produtos adquiridos no Site por valores ou condições promocionais, será considerado como valor de compra aquele efetivamente pago pelo Cliente, ficando descartado para este fim o valor originalmente cobrado pelo produto em questão.</p>\r\n    <h2>9.Pagamentos</h2>\r\n    <p>A Meelco Comercial dispõe de uma política específica para regular os meios de pagamento de Compras: Política de Pagamentos. Essa política específica integra inseparavelmente estes Termos e Condições de Uso.</p>\r\n    <h2>10.Preço</h2>\r\n    <p>O Site apresenta preços válidos apenas para compras finalizadas online, com entrega no território em que a Meelco Comercial disponibiliza entrega, nos termos do item 3 da Política de Entrega de Produtos, não sendo válida para as localidades não incluídas neste território. Em tais preços, já estão contabilizados todos os impostos incidentes, ficando excluídas apenas as despesas de frete, que serão incluídas no momento da finalização da Compra. A Meelco Comercial é uma empresa com atividades em diversos países e em múltiplas plataformas, físicas e virtuais. Assim, pode existir diferença de preços dos produtos entre diferentes lojas físicas, territórios e plataformas de atuação da Meelco Comercial, em vista de situações particulares da localidade, de tributação e de logística. Este diferença não poderá ser usada contra a Meelco Comercial para obrigar que uma plataforma reduza seu preço para equipará-lo ao de outra. A Meelco Comercial reserva-se o direito de revisar, aprimorar, modificar e/ou atualizar os preços praticados pelo Site, atendendo a critérios de necessidade, conveniência ou flutuações do mercado, sem necessidade de comunicação prévia. Todos os preços e condições veiculados no Site são válidos apenas para compras realizadas no próprio Site, não sendo aplicáveis a (i) quaisquer outros sites; (ii) lojas físicas da Meelco Comercial; (iii) lojas físicas de parceiros da Meelco Comercial. Da mesma forma, preços e condições relativos às lojas físicas não são válidos para o Site.</p>\r\n    <h2>11.Acompanhamento da Compra</h2>\r\n    <p>Além de enviar e-mails informando as alterações mais importantes no tratamento e entrega de uma Compra, a Meelco Comercial disponibiliza no Site uma ferramenta que permite aos Clientes acompanhar passo a passo a situação de sua Compra (efetuada, em análise, em trânsito, cancelada, entregue etc.). Havendo dúvida quanto à situação apresentada pela ferramenta, o Cliente poderá entrar em contato com a Meelco Comercial por meio dos canais de atendimento do CMC (Central de Atendimento Meelco Comercial).</p>\r\n    <h2>12. Entrega</h2>\r\n    <p>A Meelco Comercial dispõe de uma Política específica para regular os procedimentos de entrega de produtos adquiridos pelos Clientes no Site: Política de Entrega de Produtos. Essa política específica integra inseparavelmente estes Termos e Condições de Uso.</p>\r\n    <h2>13. Arrependimento, trocas e devoluções</h2>\r\n    <p>A Meelco Comercial dispõe de uma política específica para regular as trocas e devoluções de produtos adquiridos pelos Clientes no Site: Política de Trocas e Devoluções. Há, nesta política, igualmente disposições sobre o Direito de</p>\r\n    <p>Arrependimento. Essa política específica integra inseparavelmente estes Termos e Condições de Uso.</p>\r\n    <h2>14.Garantias</h2>\r\n    <p>Apesar dos melhores esforços da Meelco Comercial no sentido de fornecer informações precisas, atualizadas, corretas e completas, o Site poderá conter erros técnicos, inconsistências ou erros tipográficos. O Site, seu conteúdo, suas funcionalidades e ferramentas são disponibilizados pela Meelco Comercial tal qual expostos e oferecidos na Internet, sem qualquer garantia, expressa ou implícita, quanto aos seguintes itens: (i) atendimento, pelo Site ou por seu conteúdo das expectativas dos Usuários; (ii) continuidade do acesso ao Site ou a seu conteúdo; (iii) adequação da qualidade do Site ou de seu conteúdo para um determinado fim; e (iv) a correção de defeitos, erros ou falhas no Site ou em seu conteúdo. A Meelco Comercial se reserva o direito de unilateralmente modificar, a qualquer momento e sem aviso prévio, o Site bem como a configuração, a apresentação, o desenho, o conteúdo, as funcionalidades, as ferramentas ou qualquer outro elemento do Site, inclusive o seu cancelamento.</p>\r\n    <h2>15.Responsabilidades</h2>\r\n    <p>A Meelco Comercial engaja seus melhores esforços para informar, atender e proteger o Usuário. O Usuário é o único responsável pela utilização do Site, de suas ferramentas e funcionalidades. Em nenhuma hipótese, a Meelco Comercial ou seus diretores, representantes, agentes, empregados, sócios, parceiros ou prestadores de serviço serão responsabilizados por qualquer dano emergente, indireto, punitivo ou expiatório, lucros cessantes ou outros prejuízos monetários relacionados a qualquer reclamação, ação judicial ou outro procedimento tomado em relação à utilização do Site, seu conteúdo, funcionalidades e/ou ferramentas. Notadamente, fica excluída a responsabilidade da Meelco Comercial sobre as seguintes circunstâncias, entre outras: (i) danos e prejuízos que o Usuário possa experimentar pela indisponibilidade ou funcionamento parcial do Site e/ou de todos ou alguns de seus serviços, informações, conteúdos, funcionalidade e/ou ferramentas, bem como pela incorreção ou inexatidão de qualquer destes elementos; (ii) danos e prejuízos que o Usuário possa experimentar em sites de internet acessíveis por links incluídos no Site; (iii) diferenças de preços entre os artigos disponibilizados no Site e aqueles expostos à venda em outros sites da Meelco Comercial, de qualquer empresa do grupo econômico da Meelco Comercial ou em lojas físicas Meelco Comercial em todo o território nacional; (iv) danos e prejuízos que o Usuário possa experimentar em decorrência do uso do Site em desconformidade com estes Termos e Condições de Uso ou com as Políticas; (v) danos e prejuízos que o Usuário possa experimentar em decorrência do uso do Site em desconformidade com a lei, com os costumes ou com a ordem pública; (vi) danos e prejuízos que o Usuário possa experimentar em decorrência de falhas no Site, inclusive decorrentes de falhas no sistema, no servidor ou na conexão de rede, ou ainda de interações maliciosas como vírus, softwares que possam danificar o equipamento ou acessar informações do equipamento do Usuário; (vii) danos e prejuízos que o Usuário possa experimentar em decorrência de distorções que as imagens dos produtos possam apresentar, ressaltado o caráter meramente ilustrativo de tais imagens; entre outros. A responsabilidade da Meelco Comercial por vício dos produtos oferecidos à venda no Site está detalhada na Política de Trocas e Devoluções.</p>\r\n    <h2>16.Links para outros websites</h2>\r\n    <p>O Site pode conter links para sites de terceiros, os quais são inseridos apenas para conveniência do Usuário. A inclusão de tais links não implica qualquer vínculo, monitoramento ou responsabilidade da Meelco Comercial sobre os sites, respectivos conteúdos ou titulares. O acesso aos sites vinculados a tais links não é regido por esses Termos e Condições de Uso e não se encontra protegido pelas Políticas. A Meelco Comercial recomenda que o Usuário consulte os termos e condições de uso estabelecidos por cada site vinculado aos links inseridos no Site. A Meelco Comercial não será responsável, direta ou indiretamente, por quaisquer danos ou prejuízos causados ou relacionados à utilização de qualquer informação, conteúdo, bens ou serviços disponibilizados no Site ou em qualquer site de terceiros acessado por meio dos links disponibilizados no Site.</p>\r\n    <h2>17.Aplicações de Internet ou vírus de computador</h2>\r\n    <p>Em virtude de dificuldades técnicas, aplicações de Internet ou problemas de transmissão, é possível ocorrer cópias inexatas ou incompletas das informações contidas no Site. Vírus de computador ou outros programas danosos também poderão ser baixados inadvertidamente do Site. A Meelco Comercial não será responsável por qualquer aplicação, vírus de computador ou outros arquivos danosos ou invasivos ou programas que possam prejudicar ou afetar a utilização do computador ou outro bem dos Usuários devido ao acesso, utilização ou navegação no Site, ou ainda pelo download de qualquer material nele contido, sendo recomendada a instalação de aplicativos antivírus ou protetores adequados.</p>\r\n    <h2>18.Direitos de Propriedade Intelectual</h2>\r\n    <p>Marcas. O Usuário não está autorizado a utilizar, sob qualquer forma ou pretexto, as Marcas, suas reproduções parciais ou integrais ou ainda suas imitações, independentemente da destinação de tal uso. O Usuário compromete-se a não contestar a validade de qualquer Marca ou de qualquer outro sinal distintivo depositado ou registrado pela Meelco Comercial ou por quaisquer empresas a ela vinculadas, sob qualquer forma, no Brasil ou no exterior. O Usuário comprometesse a se abster de fazer qualquer uso das Marcas ou de suas variações (incluindo erros de ortografia ou variações fonéticas) como nome de domínio ou parte de nome de domínio ou em qualquer nome de empresa, de qualquer tipo ou natureza, sob qualquer meio ou forma, inclusive por meio da criação de nomes de domínio ou e- mails. Todas as outras marcas, nomes de produtos, ou nomes de companhias que aparecem no site são de propriedade exclusiva de seus respectivos titulares.<strong>Propriedade do conteúdo.</strong> Todo o conteúdo do Site - incluindo o nome de domínio [leroymerlin.com.br], programas, bases de dados, arquivos, textos, fotos, layouts, cabeçalhos e demais elementos - foi criado, desenvolvido ou cedido à Meelco Comercial, é de propriedade da Meelco Comercial ou a ela licenciado e encontra-se protegido pelas leis brasileiras e tratados internacionais que versam sobre direitos de propriedade intelectual. <strong>Proibição de utilização.</strong> O Usuário, ao acessar o Site, atesta que respeitará a existência e a extensão dos direitos de Propriedade Intelectual da Meelco Comercial, bem como de todos os direitos de terceiros que sejam usados, a qualquer título, no Site ou que venham a ser disponibilizados no Site. O acesso ao Site e a sua regular utilização pelo Usuário não lhe confere qualquer direito ou prerrogativa sobre o qualquer Propriedade Intelectual, Marca ou outro conteúdo nele inserido. É vedada a utilização, exploração, imitação, reprodução, integral ou parcial, de qualquer conteúdo sem a autorização prévia e por escrito da Meelco Comercial. É igualmente vedada a criação de quaisquer obras derivadas de qualquer Propriedade Intelectual da Meelco Comercial sem a autorização prévia e por escrito da Meelco Comercial. É expressamente proibido ao Usuário reproduzir, distribuir, modificar, exibir e criar trabalhos derivados ou qualquer outra forma de utilização de qualquer Propriedade Intelectual ou outro conteúdo deste Site e dos materiais veiculados no ou pelo Site. O Usuário que violar as proibições contidas na legislação sobre propriedade intelectual e nestes Termos e Condições de Uso serão responsabilizados, civil e criminalmente, pelas infrações cometidas. A Meelco Comercial não concede nenhuma autorização relacionada ao conteúdo do Site para qualquer fim. O Usuário assume toda e qualquer responsabilidade pela utilização indevida de qualquer Propriedade Intelectual ou Marcas da Meelco Comercial ou de terceiros, tanto de caráter civil quanto criminal. As fotos e imagens utilizadas no Site podem não refletir seu tamanho original ou situação atual do cenário reproduzido, sendo meramente ilustrativas. <strong>Conteúdo enviado pelo Cliente</strong>. Ao enviar qualquer conteúdo ao Site, o Cliente retém a titularidade de seus direitos sobre dito conteúdo (textos, vídeos, imagens, áudio, entre outros), cedendo à Meelco Comercial uma licença de caráter gratuito, irrevogável, mundial e não exclusivo para a reprodução, modificação, tradução e exibição, sob qualquer meio ou forma, inclusive no Site, declarando, ainda, o Cliente ser titular de todos os direitos relacionados ao referido conteúdo.</p>\r\n    <h2>19.Comunicações e CMC</h2>\r\n    <p>Caso o Usuário necessite de qualquer informação, esclarecimento ou atendimento com relação a esta Política de Privacidade e Segurança, a Meelco Comercial disponibiliza o CMC para receber todas as comunicações que o Usuário desejar fazer. O CMC opera por meios dos canais de comunicação listados abaixo: (a) Presencialmente, em qualquer uma das lojas físicas Meelco Comercial, durante os horários de funcionamento; (b) Pelo telefone 2225-1355, de segunda a sábado das 8h às 22h e domingos das 9h às 20h; (c) Por correspondência endereçada à MEELCO COMERCIAL, Rua Cel Carlos Oliva, 231, Tatuapé - SP, CEP 03067-010, São Paulo – SP; (d) Por Email: contato@meelcocomercial.com.br, sempre acompanhada das informações de contato do consumidor, para que possamos finalizar o atendimento. Em todos os casos, o Usuário receberá, pelo mesmo canal de comunicação, uma confirmação imediata do recebimento da sua demanda, que será tratada e respondida em um prazo máximo de 5 (cinco) dias. Além disso, a Meelco Comercial disponibiliza neste site uma seção de FAQ (Perguntas mais frequentes), bem como suas demais políticas: Política de Trocas e Devoluções, Política de Pagamentos, Política de Entrega de Produtos, Regulamento do Programa Meelco Comercial com Você e, finalmente, os Termos e Condições de Uso deste Site. Todos estes documentos podem ser consultados online ou baixados pelos usuários em formato PDF para consulta off-line e arquivo.</p>\r\n    <h2>20.Duração</h2>\r\n    <p>Estes Termos e Condições de Uso e as Políticas têm duração indefinida e permanecerão em vigor enquanto o Site estiver ativo. A redação aplicável é aquela da atualização imediatamente anterior ao acesso ou à Compra. Da mesma forma, o acesso e a utilização do Site e dos recursos por ele oferecidos têm, em principio, duração indeterminada, a exclusivo critério da Meelco Comercial. A Meelco Comercial reserva-se, no entanto, o direito de suspender e/ou cancelar, de forma unilateral e a qualquer momento, o acesso ao Site ou a algumas de suas partes ou a alguns de seus recursos, sem necessidade de prévio aviso.</p>\r\n    <h2>21.Atualizações destes Termos e Condições</h2>\r\n    <p>A Meelco Comercial poderá unilateralmente revisar, aprimorar, modificar e/ou atualizar, a qualquer momento, qualquer cláusula ou disposição contidas nestes Termos e Condições de Uso ou nas Políticas. A versão atualizada valerá para o uso do Site e para as Compras realizadas a partir de sua divulgação pela Meelco Comercial. A continuidade de acesso ou utilização deste Site, depois da divulgação de quaisquer modificações, confirmará a aceitação dos novos Termos e Condições de Uso ou das novas Políticas pelos Usuários. Caso um Cliente não esteja de acordo com uma determinada alteração das Políticas ou dos Termos e Condições de Uso, poderá rescindir seu vínculo com a Meelco Comercial por meio de pedido de exclusão da Conta no Site ou de contato com o CMC (Central de Atendimento Meelco Comercial). Esta rescisão não eximirá, no entanto, o Cliente de cumprir com todas as obrigações assumidas sob as versões precedentes das Políticas e dos Termos e Condições de Uso.</p>\r\n    <h2>22.Registro Público</h2>\r\n    <p>Estes Termos e Condições de Uso, bem como todas as Políticas, encontram- se registrados em Cartório de Registro de Títulos e Documentos da Comarca da Capital do Estado de São Paulo. Eventuais atualizações destes Termos e Condições de Uso, bem como de qualquer das Políticas, serão imediatamente registradas no mesmo cartório.</p>\r\n    <h2>23.Idioma</h2>\r\n    <p>Toda a documentação legal do Site, incluindo os presentes Termos e Condições de Uso, foi elaborada em língua portuguesa. A Meelco Comercial poderá, a seu exclusivo critério, disponibilizar traduções de tais documentos no Site apenas para conveniência do Usuário, a seu exclusivo critério. A versão portuguesa destes Termos e Condições de Uso e das Políticas é a única consentida pela Meelco Comercial. Em caso de contradição ou divergência entre a versão em português e eventual tradução para qualquer outro idioma, prevalecerá sempre a versão em língua portuguesa.</p>\r\n    <h2>24.Diversos</h2>\r\n    <p><strong>Horário oficial.</strong> Nas Compras realizadas pelo Site, deverá ser considerado oficial o horário de Brasília, inclusive nos períodos de horário de verão. <strong>Aplicabilidade parcial.</strong> Caso a Meelco Comercial não consiga fazer valer ou cumprir qualquer cláusula ou condição contida nestes Termos e Condições de Uso ou nas Políticas, tal fato não configurará desistência, tolerância ou novação dessa cláusula ou condição destes Termos ou de qualquer Política. Se alguma cláusula ou condição contida nestes Termos e Condições de Uso ou nas Políticas for declarada inexequível, no todo ou parcialmente, tal inexequibilidade não afetará as demais cláusulas dos Termos e Condições de Uso e das Políticas. Neste caso, a Meelco Comercial fará as adaptações necessárias para que reflitam, da forma mais próxima possível, os termos da provisão declarada inexequível. Características dos produtos e riscos à saúde: A Meelco Comercial inclui na página de oferta de cada produto as informações relativas às suas características e aos riscos que podem representar à saúde e à segurança dos consumidores. Antes de comprar um produto, o Cliente deve ler atentamente em sua página a descrição do uso e manuseio, bem como a indicação de faixa etária. Em caso de dúvida, deverá contatar o CMC (Central de Atendimento Meelco Comercial). <strong>Caso fortuito e força maior.</strong> Nenhuma das Partes será responsabilizada perante a outra quando o descumprimento ou o cumprimento extemporâneo de uma obrigação prevista nas Políticas ou nestes Termos e Condições de Uso for causado por casos fortuitos ou eventos de força maior, enquanto perduraram as suas consequências. <strong>Princípio de respeito aos Clientes e Usuários.</strong> A Meelco Comercial tem como princípio de sua atuação nos ambientes físicos e virtuais o respeito ao Usuário, agindo sempre em conformidade com as disposições do Código de Proteção e Defesa do Consumidor (Lei Federal n. 8078/90), do Marco Civil da Internet (Lei Federal n. 12965/14) e das demais normas referentes ao comércio de produtos em ambiente eletrônico.</p>\r\n    <h2>25.Lei aplicável e Foro de Eleição</h2>\r\n    <p>O Site é controlado, operado e administrado pela Meelco Comercial na cidade de São Paulo, Estado de São Paulo, Brasil, podendo ser acessado por qualquer dispositivo conectado à Internet, independentemente de sua localização geográfica. Em vista das diferenças que podem existir entre as legislações locais e nacionais, ao acessar o Site, o Usuário concorda que a legislação aplicável para fins destes Termos e Condições de Uso será aquela vigente na República Federativa do Brasil. A Meelco Comercial e o Usuário concordam que o Foro Central da Comarca de São Paulo, SP, Brasil, será o único competente para dirimir qualquer questão ou controvérsia oriunda ou resultante do uso do Site, renunciando expressamente a qualquer outro, por mais privilegiado que seja, ou venha a ser.</p>\r\n    <p><strong><a href=\"#\" title=\"Conheça nossos Termos e Condições de Uso do Site\">Você pode baixar os Termos e Condições de Uso do Site aqui</a></strong>.</p>\r\n  </div>\r\n</div>','2018-09-10 18:43:58','2018-12-12 21:35:32',1,0,NULL,'smartwave/porto_child',NULL,NULL,NULL,NULL),(32,'Meelco - Politica de Entregas','one_column',NULL,NULL,'meelco-politica-de-entregas','Política de Entregas','<h1>Política de Entrega de Produtos para o eCommerce</h1>\r\n<p>Confira nossa Política de Entrega de Produtos.</p>\r\n<div>\r\n  <div>\r\n    <p>A Política de Entrega de Produtos abaixo constitui parte integrante dos Termos e Condições de Uso.</p>\r\n    <h3>1. Identificação</h3>\r\n    <p>Este site é de propriedade, mantido, e operado por Meelco Comercial Omnichannel Ltda., com endereço na Rua Cel Carlos Oliva, 231, Tatuapé – São Paulo - SP, inscrita no CNPJ/MF sob o nº 26.524.420/0001-60. e endereço de e-mail contato@meelcocomercial.com.br.</p>\r\n    <h3>2. Contato – CMC (Central de Atendimento Meelco Comercial)\r\n\r\nCaso o Usuário necessite de qualquer informação, esclarecimento ou atendimento com relação a esta Política de Privacidade e Segurança, a Meelco Comercial disponibiliza o CMC para receber todas as comunicações que o Usuário desejar fazer. O CMC opera por meios dos canais de comunicação listados abaixo: (a) Presencialmente, em qualquer uma das lojas físicas Meelco Comercial, durante os horários de funcionamento; (b) Pelo telefone 2225-1355, de segunda a sábado das 8h às 22h e domingos das 9h às 20h; (c) Por correspondência endereçada à MEELCO COMERCIAL, Rua Cel Carlos Oliva, 231, Tatuapé - SP, CEP 03067-010, São Paulo – SP; (d) Por Email: contato@meelcocomercial.com.br, sempre acompanhada das informações de contato do consumidor, para que possamos finalizar o atendimento. Em todos os casos, o Usuário receberá, pelo mesmo canal de comunicação, uma confirmação imediata do recebimento da sua demanda, que será tratada e respondida em um prazo máximo de 5 (cinco) dias. Além disso, a Meelco Comercial disponibiliza neste site uma seção de FAQ (Perguntas mais frequentes), bem como suas demais políticas: Política de Trocas e Devoluções, Política de Pagamentos, Política de Entrega de Produtos, Regulamento do Programa Meelco Comercial com Você e, finalmente, os Termos e Condições de Uso deste Site. Todos estes documentos podem ser consultados online ou baixados pelos usuários em formato PDF para consulta off-line e arquivo.</p>\r\n    <h3>3. Locais atendidos</h3>\r\n    <p>A Meelco Comercial opera, diretamente ou por meio de terceiros contratados, serviços de entrega em todos os estados do Brasil. No entanto, a Meelco Comercial não disponibiliza entrega de produtos adquiridos neste Site em outros países ou territórios estrangeiros.</p>\r\n    <h3>4. Prazos de entrega</h3>\r\n    <p>Durante o processo de Compra, a Meelco Comercial informará ao Cliente uma estimativa de prazo para a entrega dos Produtos. Essa estimativa leva em conta os produtos adquiridos, as suas quantidades, o estoque disponível e a distância entre nossas centrais de distribuição e o endereço de entrega informado pelo Cliente. O prazo de entrega será contado a partir da data de aprovação do pedido, que pode ocorrer em até 3 (três) dias úteis para pagamentos com cartão de crédito ou 2 (dois) dias úteis para compras feitas com boleto.</p>\r\n    <h3>5. Horário de entrega e agendamento</h3>\r\n    <p>A Meelco Comercial efetua as entregas de Produtos entre segunda-feira e sexta-feira, das 07:00 às 23:00, podendo haver variações em casos excepcionais. Caso o endereço de entrega se localize em um condomínio, o consumidor deverá informar, no ato da compra, quaisquer restrições de horário de entrega, onde as entregas devem ser feitas no condomínio e para quem devem ser entregues, tendo em vistas as regras existentes.</p>\r\n    <p>A Meelco Comercial disponibiliza o serviço de agendamento de entrega, sem custo adicional. Por meio deste serviço, o consumidor poderá indicar, no ato da compra, a data e o turno em que a entrega dos produtos deverá ser realizada. Aos sábados, domingos e feriados a entrega não poderá ser agendada. A Meelco Comercial agenda as entregas entre segunda-feira e sexta-feira e em três turnos: manhã (das 07:00 às 11:00), tarde (das 12:00 às 18:00) e noite (das 19:00 às 23:00). Não será possível alterar a data ou o turno da entrega após o agendamento. A data e turno agendados serão concretizados apenas após a confirmação do pagamento. Se a confirmação do pagamento de seu pedido prejudicou a data inicial de agendamento da sua entrega, uma nova data será disponibilizada.</p>\r\n    <h3>6. Valor do frete</h3>\r\n    <p>O valor do frete da entrega dos Produtos é calculado automaticamente pelo Site no momento da Compra, a partir do peso, volume e quantidade dos Produtos adquiridos, assim como da distância entre nossos centros de distribuição e o local de entrega informado pelo Cliente. A seu exclusivo critério, a Meelco Comercial poderá disponibilizar em seu Site categorias especiais de frete, específicas para alguns produtos e para algumas localidades, de forma definitiva ou temporária. Neste caso, é possível que cada categoria ofereça preços e prazos de entrega diferentes, cabendo ao Cliente escolher aquela categoria que atenda a suas expectativas.</p>\r\n    <h3>7. Condições da entrega</h3>\r\n    <p>A Meelco Comercial entregará os Produtos adquiridos em sua embalagem original. Considerando que os entregadores da Meelco Comercial não são autorizados a montar, instalar ou desmontar os Produtos, retirar portas ou janelas, transportar os Produtos por escadarias ou içá-los pela parte externa do edifício ou, ainda, realizar qualquer atividade que seja diversa da simples entrega do Produto, é necessário que o consumidor certifique-se que as dimensões do Produto são compatíveis com as dimensões das portas, elevadores, passagens e corredores do local de entrega por ele escolhido. Em edifícios, a entrega será efetuada no local da portaria, sendo o Cliente exclusivamente responsável pela guarda e transporte dos produtos até seu andar e unidade. Para que a entrega seja realizada, é necessário que o Cliente autorize uma pessoa maior de 18 anos (amigos, parentes, porteiros ou outra) para receber e conferir os produtos e assinar o respectivo protocolo. O serviço de entrega não inclui qualquer outra atividade por parte dos entregadores, estando a Meelco Comercial isenta de qualquer obrigação de instalação, montagem, desmontagem ou teste dos produtos adquiridos e entregues. Produtos básicos (tijolo, bloco, telha, vergalhão, laje, coluna, areia, brita, entre outros) serão entregues na calçada em frente ao endereço de entrega, devendo o Cliente se encarregar de transportá-los para o interior do local.</p>\r\n    <h3>8. Recusa de recebimento</h3>\r\n    <p>O Cliente poderá e deverá verificar os seguintes aspectos no momento do recebimento: (i) se a embalagem estiver aberta, violada ou danificada; (ii) se o Produto estiver avariado pelo transporte, aberto, violado ou usado; (iii) se os Produtos entregues não corresponderem aos Produtos adquiridos pelo Site e/ou à nota fiscal; ou, ainda, (iv) se o conteúdo das embalagens estiver incompleto, sem partes ou acessórios dos produtos adquiridos. Em caso de qualquer divergência, o Cliente deverá recusar-se a receber o Produto em questão e entrar em contato com o CMC (Central de Atendimento Meelco Comercial), para imediata solução do problema identificado. Caso haja o recebimento indevido do produto, o Cliente poderá requerer sua troca apenas nos casos previstos na Política de Trocas e Devoluções.</p>\r\n    <h3>9. Tentativas de entrega</h3>\r\n    <p>A Meelco Comercial entregará os Produtos adquiridos, no prazo estabelecido e no endereço informado pelo Cliente. Caso não seja possível a Meelco Comercial realizar a entrega dos Produtos por ausência do Cliente, de pessoa autorizada, por restrições de horário do condomínio ou por limitações físicas que impeçam a entrega ou, ainda, por erro do Cliente em indicar o local correto da entrega no ato da compra dos Produtos, a Meelco Comercial fará mais duas tentativas subsequentes. Caso as três tentativas de entrega fracassem, os produtos adquiridos serão devolvidos à central de distribuição, o pedido será cancelado e o reembolso ocorrerá nos mesmos termos previstos na Política de Trocas e Devoluções com relação à devolução por arrependimento (item 4.5 da referida Política). No caso de entregas agendadas, será feita apenas uma tentativa de entrega, na data e turno agendados. Em caso de fracasso desta entrega, a Meelco Comercial entrará em contato com o Cliente para definir uma segunda data de entrega. Se esta segunda entrega for sem sucesso, os Produtos adquiridos serão devolvidos à central de distribuição e o pedido será cancelado.</p>\r\n    <h3>10. Saiba tudo sobre o Clique e Retire</h3>\r\n    <p>A Meelco Comercial disponibiliza a possibilidade de realização da compra pelo site e retirada pelo próprio cliente nas lojas físicas Meelco Comercial, que oferecem o serviço de retirada de pedidos feitos pelo site (Consulte as lojas participantes indicadas no ato da compra).</p>\r\n    <p>10.1. Como utilizar? Para aderir a nova modalidade, basta escolher os produtos que deseja comprar (sempre indicados com um carrinho), selecionar a opção &ldquo; Retire na Loja&rdquo; no momento do pagamento (verifique o local em que você deverá buscar o pedido), finalizar o pedido e aguardar por mais informações. Quando o produto estiver disponível para a retirada, enviaremos um e-mail informando.</p>\r\n    <p>10.2. Sobre a compra Após aprovação do pedido pela instituição financeira, o pedido estará disponível para a retirada no ponto de retirada escolhido, conforme estabelecido no ato da compra. Caso a aprovação do pagamento do pedido ocorra até às 14h, o mesmo poderá ser retirado na loja no dia útil seguinte. Para o serviço &ldquo;Clique e Retire&rdquo;, não será cobrado nenhum valor relativo a frete ou taxa de entrega. É imprescindível que as informações de contato do cadastro estejam atualizadas e isso garantirá sucesso, em possíveis contatos que se façam necessários.</p>\r\n    <p>10.3. Sobre a retirada Será encaminhado um e-mail para o cliente, comunicando que o pedido está disponível para a retirada. O cliente poderá conferir o status de seu pedido na seção de &ldquo;Minha conta&rdquo; contido no site. O pedido ficará disponível para retirar no ponto de retirada escolhido no prazo máximo de 7 (sete) dias corridos, a contar da data da aprovação do pagamento. Caso o pedido não seja retirado neste prazo, será automaticamente cancelado. Se houver o cancelamento do pedido, o cliente poderá optar entre receber um vale com o valor da compra, que para ser resgatado e utilizado bastará a apresentação do CPF em qualquer Loja Meelco Comercial, ou receber o estorno do valor pago de acordo com o meio de pagamento utilizado (estorno se cartão de crédito ou depósito em conta se realizado por Boleto Bancário), nos termos do item 4.5 da Política de Trocas e Devoluções. O horário de retirada do pedido será de acordo com o horário de funcionamento do ponto de retirada escolhido. Ao comparecer no local de retirada, o cliente deverá informar que a compra foi realizada através do serviço &ldquo;Clique e Retire&rdquo;. A entrega do pedido será realizada no local de retirada participante escolhido pelo cliente, sendo que será de exclusiva responsabilidade do cliente a retirada do produto na área de atendimento do local, o carregamento e o transporte até seu destino final. Para a retirada do pedido, o cliente deverá apresentar: Documento original com foto e o número do seu pedido. No caso de retirada por terceiro, será necessário apresentar: Documentos originais com fotos de quem está retirando a mercadoria, do titular da compra, a página do pedido impressa, bem como autorização assinada pelo comprador (modelo disponível no site). Para retirada de pedidos de Pessoa Jurídica apresentar cópia autenticada do Contrato Social/Estatuto da empresa e documento original com foto do representante legal. Caso o pedido de Pessoa Jurídica seja retirado por terceiro, apresentar (além da cópia autenticada do contrato Social/ Estatuto e documento original com foto de quem está retirando) o termo de autorização assinado pelo representante legal da empresa. Confira aqui o modelo do termo de autorização.</p>\r\n    <p>10.4. Sobre a troca ou cancelamento Caso ocorra o cancelamento do pedido, o cliente poderá optar por receber um vale com o valor da compra, que para ser resgatado e utilizado bastará a apresentação do CPF em uma das lojas físicas Meelco Comercial, ou receber o estorno do valor pago, de acordo com o meio de pagamento utilizado (seja ele Cartão de Crédito ou Boleto Bancário), nos termos do item 4.5 da Política de Trocas e Devoluções. Solicitações de cancelamento por arrependimento, nos termos do artigo 49 do Código de Defesa do Consumidor, deverão ser feitas através dos canais de atendimento ao consumidor, em até 7 (sete) dias corridos a contar da data da retirada.</p>\r\n    <h3>11. Devolução por erro no cadastro</h3>\r\n    <p>A Meelco Comercial não se responsabiliza caso o pedido seja entregue no endereço incorreto por erro de cadastramento. Os dados cadastrais são de inteira responsabilidade do cliente. Caso haja algum problema na entrega dos produtos por erro no endereço cadastrado, o custo de reenvio dos produtos será de responsabilidade do cliente, inclusive do novo produto, na eventualidade do 1º endereço informado incorretamente não ser localizado.</p>\r\n    <h3>12. Diversos</h3>\r\n    <p>Alterações do pedido. A Meelco Comercial não aceitará alterações do pedido (formas de pagamento, quantidades, local, data ou turno da entrega) após a finalização do processo de Compra no Site.</p>\r\n    <p>Atrasos. Algumas situações excepcionais podem causar atrasos na entrega dos Produtos adquiridos, como a indicação de um endereço errado, incompleto ou inexistente ou a ocorrência de fatores naturais (chuvas, enchentes) ou humanos (greves, manifestações, acidentes), conhecidos como eventos de caso fortuito e força maior. Nestes casos, a Meelco Comercial fará o possível para manter o Cliente informado com relação ao problema que causou o atraso e para efetivar a entrega no menor prazo possível.</p>\r\n    <p>Retenções. Caso os Produtos adquiridos sejam retidos por autoridades fiscais em decorrência de pendências do Cliente, a Meelco Comercial informará a situação imediatamente, ficando, no entanto, isenta do dever de entregar, uma vez que os Produtos só poderão ser liberados pela autoridade competente mediante o comparecimento do Cliente.</p>\r\n    <p>Alertas. A Meelco Comercial poderá enviar e-mails ou mensagens SMS ao Cliente a fim de informar qualquer alteração no processo de entrega de seu pedido, como a saída dos produtos do centro de distribuição, o deslocamento pela cidade, o horário estimado de entrega, eventuais atrasos, entre outros.</p>\r\n  </div>\r\n</div>','2018-09-10 18:56:59','2018-12-12 21:35:58',1,0,NULL,'smartwave/porto_child',NULL,NULL,NULL,NULL),(33,'Meelco - Política de Trocas','one_column',NULL,NULL,'meelco-politica-de-trocas','Meelco - Política de Troca e Devolução de Produtos','<h1>Política de Troca e Devolução de Produtos</h1>\r\n<p>Confira nossa Política de Troca e Devolução de Produtos</p>\r\n<div>\r\n  <div>\r\n    <p>A Política de Troca e Devolução de Produto constitui parte integrante dos Termos e Condições de Uso deste Site.</p>\r\n    <h3>1. Identificação <br>\r\n    </h3>\r\n    <p>Este site é de propriedade, mantido, e operado por Meelco Comercial Omnichannel Ltda., com endereço na Rua Cel Carlos Oliva, 231, Tatuapé – São Paulo - SP, inscrita no CNPJ/MF sob o nº 26.524.420/0001-60.</p>\r\n    <p><strong>2. Contato – CMC (Central de Atendimento Meelco Comercial)</strong></p>\r\n    <p>Caso o Usuário necessite de qualquer informação, esclarecimento ou atendimento com relação a esta Política de Privacidade e Segurança, a Meelco Comercial disponibiliza o CMC para receber todas as comunicações que o Usuário desejar fazer. O CMC opera por meios dos canais de comunicação listados abaixo: (a) Presencialmente, em qualquer uma das lojas físicas Meelco Comercial, durante os horários de funcionamento; (b) Pelo telefone 2225-1355, de segunda a sábado das 8h às 22h e domingos das 9h às 20h; (c) Por correspondência endereçada à MEELCO COMERCIAL, Rua Cel Carlos Oliva, 231, Tatuapé - SP, CEP 03067-010, São Paulo – SP; (d) Por Email: contato@meelcocomercial.com.br, sempre acompanhada das informações de contato do consumidor, para que possamos finalizar o atendimento. Em todos os casos, o Usuário receberá, pelo mesmo canal de comunicação, uma confirmação imediata do recebimento da sua demanda, que será tratada e respondida em um prazo máximo de 5 (cinco) dias. Além disso, a Meelco Comercial disponibiliza neste site uma seção de FAQ (Perguntas mais frequentes), bem como suas demais políticas: Política de Trocas e Devoluções, Política de Pagamentos, Política de Entrega de Produtos, Regulamento do Programa Meelco Comercial com Você e, finalmente, os Termos e Condições de Uso deste Site. Todos estes documentos podem ser consultados online ou baixados pelos usuários em formato PDF para consulta off-line e arquivo.</p>\r\n    <h3>&nbsp;</h3>\r\n    <p>3.Política aplicável a Compras realizadas por meio do Site <br>\r\n      3.1. Devolução ou troca por arrependimento da Compra<br>\r\n      3.1.1. Caso o Cliente se arrependa de uma compra efetuada poderá entrar em contato com a Central de Atendimento Meelco Comercial e manifestar seu interesse na devolução ou troca do produto no prazo de 7 (sete) dias corridos contados a partir da data do recebimento.<br>\r\n      3.1.2. O produto deverá estar dentro das condições previstas no item 3.3.1 e poderá ser reenviado para a Meelco Comercial observando uma das opções do item 3.3.2 desta Política.<br>\r\n      3.1.3. Excepcionalmente, a Meelco Comercial poderá, a seu exclusivo critério, retirar o produto em local indicado pelo cliente, mediante prévio agendamento.<br>\r\n      3.1.4. Caso o produto não esteja dentro das condições previstas no item 3.3.1, o Cliente será notificado informando que o seu direito ao arrependimento não poderá ser exercido podendo retirar o produto ou arcar com os custos de frete para a sua nova entrega.<br>\r\n    </p>\r\n    <p>3.2. Devolução ou troca por defeito no produto<br>\r\n      4.3.2.1. A Meelco Comercial efetuará a troca do produto adquirido por seus Clientes de acordo com o Código de Defesa do Consumidor.<br>\r\n      3.2.2. O Cliente poderá devolver ou trocar o produto se identificar defeito técnico ou de fabricação, devendo o Cliente comunicar a Central de Atendimento Meelco Comercial e seguir as instruções recebidas para que o pedido de devolução ou troca seja analisado e processado.<br>\r\n      3.2.3. Caso identificado o defeito técnico ou de fabricação, no prazo de até 7 (sete) dias corridos, contados da data do recebimento do produto e ele estiver dentro das condições descritas no item 3.3.1, o Cliente poderá optar pelo:<br>\r\n      a) Envio de produto idêntico, de mesma marca, linha, modelo e versão, sem qualquer custo adicional; ou<br>\r\n      b) Emissão de Vale Compras no valor do produto para utilização em qualquer loja física ou pelo televendas com o estorno do valor total do frete. 3.2.4. Havendo indisponibilidade do produto a ser trocado, o Cliente poderá optar pela:<br>\r\n      a) Troca imediata por qualquer produto disponível na Meelco Comercial, com compensação em caso de diferença de preço; ou<br>\r\n      b) Estorno do valor da compra, ou seja, preço do produto e do frete de acordo com o item 3.3 desta Política.<br>\r\n      3.2.5. Caso o defeito técnico ou de fabricação seja identificado após o prazo de 7 (sete) dias corridos, o Cliente deverá encaminhar o produto para a assistência técnica do fabricante. O CMC poderá auxiliar o Cliente na localização dos serviços de assistência técnica. Caso o problema não seja solucionado, pela assistência técnica do fabricante, no prazo de até 30 (trinta) dias corridos, o Cliente poderá entrar em contato com o CMC para novas orientações.<br>\r\n      3.2.6. Caso o Cliente receba produto diferente ao originalmente adquirido, o Cliente deverá recusar a entrega, ou, caso tiver recebido, solicitar a troca do produto em até 7 (sete) dias corridos a contar da data do seu recebimento.<br>\r\n    </p>\r\n    <p>3.3. Condições gerais de devolução ou troca de produto por defeito ou arrependimento. Qualquer devolução ou troca deverá ser comunicado ao CMC antes do reenvio do produto para a Meelco Comercial.<br>\r\n      3.3.1. Condições do produto<br>\r\n      Ao receber qualquer produto reenviado pelo Cliente, a Meelco Comercial somente aceitará se as condições abaixo foram atendidas:<br>\r\n      a) O produto deverá ser encaminhado em sua embalagem original, com todos os manuais, certificados de garantia e acessórios;<br>\r\n      b) O produto não poderá ter sido testado, usado ou consumido, exceto para os casos de vício ou defeito técnico ou de fabricação constatado após utilização.<br>\r\n      c) O produto deve estar acompanhado do Cupom ou Nota Fiscal de Venda.<br>\r\n      3.3.2. Opções de reenvio de produto para a Meelco Comercial<br>\r\n      O Cliente poderá reenviar o produto para a Meelco Comercial de duas maneiras:<br>\r\n      a) Entregando-o em qualquer loja física; ou<br>\r\n      b) Enviando-o através dos Correios. Ao optar por enviar o produto através dos Correios, o Cliente deverá solicitar ao CMC orientações de envio e um código de postagem que deverá ser informado aos Correios no ato do envio do produto.<br>\r\n    </p>\r\n    <p>3.4. Condições para devolução de valores<br>\r\n      3.4.1. Em caso de cancelamento da compra, a Meelco Comercial providenciará a devolução dos valores ao Cliente de acordo com o meio de pagamento utilizado.<br>\r\n      3.4.2. Se o pagamento foi realizado por cartão de crédito, a Meelco Comercial acionará a administradora de cartão de crédito, em até 72 horas, após o recebimento da solicitação de estorno enviada ao CMC pelo Cliente.<br>\r\n      3.4.3. O prazo de efetivação do estorno ao Cliente é de exclusiva responsabilidade da administradora do cartão podendo ocorrer em até 2 (duas) faturas posteriores.<br>\r\n      3.4.4. Se o pagamento foi realizado por boleto bancário a devolução será efetuada por meio de depósito bancário, em até 10 (dez) dias úteis, a contar do recebimento do produto pela Meelco Comercial.<br>\r\n      3.4.5. Não será concedido crédito para terceiros. O CPF do titular da conta corrente deverá ser o mesmo CPF constante no pedido.<br>\r\n      3.4.6. O ressarcimento do frete será proporcional a quantidade de produto devolvido constante de um pedido e será realizado em qualquer loja física ou através do CMC.<br>\r\n      3.4.7. O valor do frete proporcional será calculado com base no valor do frete pago e o peso do produto devolvido.<br>\r\n    </p>\r\n    <p>4.Política aplicável a Compras realizadas em lojas físicas ou televendas<br>\r\n      4.1. Devolução ou troca por defeito no produto<br>\r\n      4.1.1. A Meelco Comercial efetuará a troca do produto adquirido por seus Clientes de acordo com o Código de Defesa do Consumidor.<br>\r\n      4.1.2. Caso identificado defeito técnico ou de fabricação no produto, no prazo de até 7 (sete) dias corridos, contados da data do recebimento do produto ou retiradna loja, o Cliente poderá optar por:<br>\r\n      a) Produto idêntico, de mesma marca, linha, modelo e versão, sem qualquer custo adicional; ou<br>\r\n      b) Emissão de Vale Compras no valor do produto para utilização em qualquer loja física ou pelo televendas.<br>\r\n      4.1.3. Havendo indisponibilidade do produto a ser trocado, o Cliente poderá optar pela:<br>\r\n      a) Troca imediata por qualquer produto disponível na Meelco Comercial, com compensação em caso de diferença de preço; ou<br>\r\n      b) Estorno do valor da compra.<br>\r\n      4.1.4. Caso o defeito técnico ou de fabricação, seja identificado após o prazo de 7 (sete) dias corridos, o Cliente deverá encaminhar o produto para a assistência técnica do fabricante. O CMC poderá auxiliar o Cliente na localização dos serviços de assistência técnica.<br>\r\n      4.1.5. Caso o problema não seja solucionado, pela assistência técnica do fabricante, no prazo de até 30 (trinta) dias corridos, o Cliente poderá entrar em contato com o CMC para novas orientações.<br>\r\n      4.1.6. Caso o Cliente receba produto diferente ao originalmente adquirido, o Cliente deverá recusar a entrega, ou, caso tiver recebido, solicitar a troca do produto em até 7 (sete) dias corridos a contar da data do seu recebimento.<br>\r\n    </p>\r\n    <p>4.2. Devolução ou troca de produtos sem defeito &ldquo;TROCA FÁCIL&rdquo;<br>\r\n      4.2.1. A Meelco Comercial possui o serviço conhecido como &ldquo;Troca Fácil&rdquo;, isto significa que se as condições gerais abaixo descritas forem respeitadas, a Meelco Comercial prontamente realizará a troca do produto adquirido.<br>\r\n      4.2.2. A Meelco Comercial efetuará a troca de produto sem vício ou defeito no prazo máximo de 30 dias corridos contados após a emissão da nota fiscal.<br>\r\n      4.2.3. A Meelco Comercial verificará as condições do produto, que deverá estar em perfeito estado e em condições de venda não podendo ter sinal de utilização ou instalação.<br>\r\n      4.2.4. Os produtos adquiridos em saldo, sob encomenda, por metro e tintas preparadas no centro de cores ficam sem possibilidade de troca.<br>\r\n      4.2.5. Eletroeletrônicos, aquecedores, móveis e máquinas em geral, quando apresentarem sinais de instalação e/ou utilização, somente poderão ser trocados com a apresentação de laudo técnico atestando o vício ou defeito.<br>\r\n      4.2.6. Os produtos cerâmicos não poderão ser trocados, exceto se no ato da entrega o Cliente verificar que se trata de produto diferente da compra realizada.<br>\r\n      4.2.7. Os produtos que possuem partes de vidro são conferidos no caixa e, desta forma, a troca só será realizada caso o produto esteja em perfeitas condições;<br>\r\n    </p>\r\n    <p>4.3. Devolução ou troca de produto com boleto faturado (Pessoa Jurídica)<br>\r\n      4.3.1. O Cliente deverá comparecer na Loja de origem do pedido de venda, com os produtos e o espelho da nota fiscal para devolução da mercadoria.<br>\r\n      4.3.2. Caso o pedido tenha sido entregue, é necessário que o Cliente efetue pagamento de valor de novo frete para que a loja realize a retirada da mercadoria.<br>\r\n      4.3.3. O frete não será cobrado em casos de devolução ou troca de produto com defeito técnico ou de fabricação.<br>\r\n      4.3.4. O Assessor Pessoa Jurídica entrará em contato com a Loja para agendar a data de retirada dos produtos do local.<br>\r\n      4.3.5. O boleto atualizado será enviado via e-mail em até 48 horas úteis.<br>\r\n      4.3.6. Em caso de devolução total a Meelco Comercial efetuará o abatimento dos valores e o cancelamento do pedido de venda.<br>\r\n      4.3.7. Para adquirir um novo produto basta encaminhar solicitação para o endereço de e-mail analisepj@leroymerlin.com.brencaminhando juntamente com a ordem de compra. <br>\r\n    </p>\r\n    <p><strong>ATENDIMENTO AO CLIENTE</strong> <br>\r\n      CMC - Central de Atendimento Meelco Comercial <br>\r\n    </p>\r\n    <p>Caso o Cliente necessite de qualquer informação ou atendimento em relação a Política de Troca e Devolução de Produtos, a Meelco Comercial disponibiliza o CMC através do telefone (11) 2225-1355, de segunda a sábado das 8h às 22h e domingos das 9h às 20h.</p>\r\n    <p><strong><a href=\"#\" title=\"Confira nossa Políticas de Troca e Devolução eCommerce\">Você pode baixar essa política aqui</a></strong>.</p>\r\n  </div>\r\n</div>\r\n','2018-09-10 19:07:47','2018-12-12 21:36:23',1,0,NULL,'smartwave/porto_child',NULL,NULL,NULL,NULL),(34,'Meelco - Politica de Pagamentos','one_column',NULL,NULL,'meelco-politica-de-pagamentos','Política de Pagamentos','<p>Confira a Políticas de Pagamentos para compras online</p>\r\n<div>\r\n  <div>\r\n    <p>A Política de Pagamentos abaixo constitui parte integrante dos Termos e Condições de Uso.</p>\r\n    <h3>1. Identificação <br>\r\n    </h3>\r\n    <p>Este site é de propriedade, mantido, e operado por Meelco Comercial Omnichannel Ltda., com endereço na Rua Cel Carlos Oliva, 231, Tatuapé – São Paulo - SP, inscrita no CNPJ/MF sob o nº 26.524.420/0001-60.</p>\r\n    <p><strong>2. Contato – CMC (Central de Atendimento Meelco Comercial)</strong></p>\r\n    <p>Caso o Usuário necessite de qualquer informação, esclarecimento ou atendimento com relação a esta Política de Privacidade e Segurança, a Meelco Comercial disponibiliza o CMC para receber todas as comunicações que o Usuário desejar fazer. O CMC opera por meios dos canais de comunicação listados abaixo: (a) Presencialmente, em qualquer uma das lojas físicas Meelco Comercial, durante os horários de funcionamento; (b) Pelo telefone 2225-1355, de segunda a sábado das 8h às 22h e domingos das 9h às 20h; (c) Por correspondência endereçada à MEELCO COMERCIAL, Rua Cel Carlos Oliva, 231, Tatuapé - SP, CEP 03067-010, São Paulo – SP; (d) Por Email: contato@meelcocomercial.com.br, sempre acompanhada das informações de contato do consumidor, para que possamos finalizar o atendimento. Em todos os casos, o Usuário receberá, pelo mesmo canal de comunicação, uma confirmação imediata do recebimento da sua demanda, que será tratada e respondida em um prazo máximo de 5 (cinco) dias. Além disso, a Meelco Comercial disponibiliza neste site uma seção de FAQ (Perguntas mais frequentes), bem como suas demais políticas: Política de Trocas e Devoluções, Política de Pagamentos, Política de Entrega de Produtos, Regulamento do Programa Meelco Comercial com Você e, finalmente, os Termos e Condições de Uso deste Site. Todos estes documentos podem ser consultados online ou baixados pelos usuários em formato PDF para consulta off-line e arquivo.</p>\r\n    <h3>3. Meios de pagamento<br>\r\n  </h3>\r\n    <p>3.1. Cartão de Crédito<br>\r\n      3.1.1. O Cliente poderá utilizar 1 (um) ou 2 (dois) cartões de crédito emitidos no Brasil em seu nome, seja como titular ou dependente, com as seguintes bandeiras: Visa®, Mastercard®, Elo, Hiper, Diners, Celebre! e American Express®.<br>\r\n      3.1.2. O prazo de aceitação do pedido é de até 48 horas a contar da data da aprovação do pagamento pela instituição bancária.<br>\r\n    </p>\r\n    <p>3.2. Boleto Bancário<br>\r\n      3.2.1. O prazo do boleto bancário é de 1 (um) dia útil e o seu pagamento deverá ser à vista, em parcela única e no valor total da Compra realizada.<br>\r\n      3.2.2. A confirmação do recebimento do valor ocorrerá em até 2 (dois) dias úteis a contar do vencimento do boleto bancário.<br>\r\n      3.2.3. Caso o pagamento do boleto bancário seja através de cheque, o prazo para confirmação de recebimento será de até 5 (cinco) dias úteis, após a compensação do cheque.<br>\r\n      3.2.4. O pedido prosseguirá para o fluxo de envio após a confirmação do recebimento do pagamento pela Meelco Comercial.<br>\r\n      3.2.5. O pedido será automaticamente cancelado em caso de não pagamento ou pagamento com valor diferente do que consta no boleto bancário.<br>\r\n    </p>\r\n    <h3>4. Pedido de Compra<br>\r\n    </h3>\r\n    <p>4.1. A Meelco Comercial disponibiliza uma página descritiva para cada produto, com informações relativas à característica, composição, eventual risco à saúde e segurança, o prazo de validade, origem, disponibilidade em estoque, condição de pagamento e preço total à vista e parcelado.<br>\r\n      4.2. Após escolher o produto o Cliente será direcionado para o carrinho e poderá visualizar: o produto, a quantidade escolhida, o valor, bem como calcular o frete. Após visualização dos dados será necessário identificar as informações de entrega e escolher o meio de pagamento.<br>\r\n      4.3. A Meelco Comercial, imediatamente, enviará um e-mail ao Cliente indicando o número da Compra, o produto, a quantidade, o preço, o valor do frete, o meio de pagamento e o prazo estimado ou o agendamento de entrega.<br>\r\n      4.4. Após a finalização da Compra, por medida de segurança, a Meelco Comercial não aceitará alterações de meio de pagamento, produto, quantidade do produto, local de entrega, dados cadastrais e data ou turno da entrega.<br>\r\n      4.5. Para alterar o meio de pagamento em Compra realizada através de boleto bancário, basta não efetuar seu pagamento que o boleto será automaticamente cancelado. Após, basta refazer a Compra e escolher o meio de pagamento de sua preferência dentre os disponíveis no Site.<br>\r\n      4.6. Durante o processo de Compra será informado uma estimativa de prazo para a entrega do produto considerando: o produto, sua quantidade, o estoque disponível e a distância entre nossas centrais de distribuição e o endereço de entrega informado pelo Cliente.<br>\r\n      4.7. O prazo de entrega será contado a partir da data de aprovação do pagamento pelas instituições bancárias e poderá variar de acordo com o meio e forma de pagamento escolhida.<br>\r\n      4.8. A escolha da transportadora é de responsabilidade exclusiva da Meelco Comercial.<br>\r\n    </p>\r\n    <h3>5. Segurança dos Pagamentos<br>\r\n    </h3>\r\n    <p>5.1. A Compra poderá ser cancelada caso haja qualquer inconformidade relacionada a qualquer dado informado pelo Cliente.<br>\r\n      5.2. Em Compras realizadas através de cartão de crédito, por medida de segurança, terceiro credenciado poderá entrar em contato com o Cliente solicitando dados de acordo com a necessidade para confirmação da Compra.<br>\r\n      5.3. Para informações mais específicas consulte nossa Política de Privacidade e Segurança.<br>\r\n    </p>\r\n    <p><strong><a href=\"#\" title=\"Confira nossa Política de Pagamento para o eCommerce\">Você pode baixar essa política aqui</a></strong></p>\r\n  </div>\r\n</div>','2018-09-10 19:22:14','2018-12-12 21:36:11',1,0,NULL,'smartwave/porto_child',NULL,NULL,NULL,NULL);
